(192, '2022-08-05 22:34:31', 'The train passes by the Slavyansky bulvar passenger train station of Line D1 (Moscow Central Diameters) of Moscow\n\nChS7 are the next and the last in line of 8-axle two-sections articulated 3kV DC electric passenger locomotives designed and built by Škoda Works in Czechoslovakia and later in Czechia for railways of Soviet Union. After a small series of powerfull and fastest (8 x 1000 kW, peak 8400 kW totally, 220 max. speed) ChS200 locomotives (12 ones built at 1974-79) and equivalently powered but more slower (190 km/h max) ChS6 passenger locomotives (30 ones for 1979-81) this locomotive strangely obtained less powered motors (8 x 770 kW) but improved electrical circiuts and were built by biggest seria of 321 ones from 1983 to 1997. Today the biggest part of locomotives are used by the Moscow Railway division of Russian Railways. Some are used in Ukraine.', 'https://live.staticflickr.com/65535/52534316151_21497168e6_o.jpg', 'https://live.staticflickr.com/65535/52534316151_f36fe44b1f.jpg', '55.730215', '37.470288', 'Cetus13', 'CHs7 (ЧС7-094) electric locomotive leads the night train to Belarus departured from the Belarus railway terminal of Moscow', 226),
