(217, '2022-08-09 15:46:54', 'ChS7 are the next and the last in line of 8-axle two-sections articulated 3kV DC electric passenger locomotives designed and built by Škoda Works in Czechoslovakia and later in Czechia for railways of Soviet Union. After a small series of powerfull and fastest (8 x 1000 kW, peak 8400 kW totally, 220 max. speed) ChS200 locomotives (12 ones built at 1974-79) and equivalently powered but more slower (190 km/h max) ChS6 passenger locomotives (30 ones for 1979-81) this locomotive strangely obtained less powered motors (8 x 770 kW) but improved electrical circiuts and were built by biggest seria of 321 ones from 1983 to 1997. Today the biggest part of locomotives are used by the Moscow Railway division of Russian Railways. Some are used in Ukraine.', 'https://live.staticflickr.com/65535/52532163784_df562967a3_o.jpg', 'https://live.staticflickr.com/65535/52532163784_d50178f79b.jpg', '55.778290', '37.657828', 'Cetus13', 'ChS7 (ЧС7-236) electric locomotive arrives on a Yaraslavl Railway terminal of Moscow with passenger train Vorkuta - Moscow', 294),
(218, '2022-08-09 15:47:35', 'ChS7, next and the last in line of 8-axle two-section 3kV DC electric passenger locomotives designed and built by Škoda Works in Czechoslovakia and later in Czechia for railways of Soviet Union. After a small series of powerfull and fastest (8 x 1000 kW, peak 8400 kW totally, 220 max. speed) ChS200 locomotives (12 ones built at 1974-79) and equivalently powered but more slower (190 km/h max) ChS6 passenger locomotives (30 ones for 1979-81) this locomotive strangely obtained less powered motors (8 x 770 kW) but improved electrical circiuts and were built by biggest seria of 321 ones from 1983 to 1997. Today the biggest part of locomotives are used by the Moscow Railway division of Russian Railways. Some are used in Ukraine.', 'https://live.staticflickr.com/65535/52531412827_2fb51a6f9c_o.jpg', 'https://live.staticflickr.com/65535/52531412827_50eb09207a.jpg', '55.778290', '37.657828', 'Cetus13', 'ChS7 (ЧС7-236) DC electric passenger locomotive made by Škoda', 227),
(219, '1916-03-06 00:00:00', 'Size 8.8 cm x 13.9 cm\n\nCard penned by soldier Stork in Russia to his children in Lengerich on 6.3.1916. Stork was soldier in Reserve Infanterie Regiment Nr. 218.\n\n01211_00000_FPP_01', 'https://live.staticflickr.com/65535/52531307092_d7e92f7cc1_o.jpg', 'https://live.staticflickr.com/65535/52531307092_dfa0b46130.jpg', '52.189712', '7.853507', 'bw-collector', 'Patriotic postcard from Russia to Lengerich', 125),
(220, '2022-11-29 09:17:09', 'Reverse\n\nTranscription:\n\nFeld-Postkarte\n\nAn\nFrau H. Stork\npr. Andr. Mietenkorte \nIntrup 5.a.\nin Lengerich i. / Westf(alen).\nKreis Te(c)klenburg\n\nAbsender:\nWehrm(ann). Stork\nReser(ve). Reg(imen)t. 2/218.\n\nRußland den 6.3.16.\n\nLiebe Anna u(nd). Willi\nHoffentlich seid Ihr noch gesund\nwelches bei mir auch noch der\nfall ist. Habe Deine Karte erhalten\nauch die aus Münster(.) Könnten\nwir doch wieder alle zusammen\nsein(.) Hoffentlich dauert es nicht\nmehr lange. Nun seid herzlich \ngegrüßt von Euren lieben \nVater. Auf Wiedersehen.\n\n01211_00000_FPP_01', 'https://live.staticflickr.com/65535/52531778181_86a544feb5_o.jpg', 'https://live.staticflickr.com/65535/52531778181_31dd55820a.jpg', '52.189712', '7.853507', 'bw-collector', 'Patriotic postcard from Russia to Lengerich', 43),
(221, '2022-04-02 16:24:06', '092/365#20220402 - Germany - Leipzig: Russian Memorial Church. The church is a free replica of the Church of the Resurrection in Moscow-Kolomenskoye, built in 1530-1532. It serves to commemorate the 22,000 Russian soldiers who fell in and around Leipzig during the Battle of the Nations in 1813.', 'https://live.staticflickr.com/65535/52531405824_37d1f92640_o.jpg', 'https://live.staticflickr.com/65535/52531405824_437b813ed2.jpg', '51.323969', '12.396780', 'Christian R. Rohleder', '092/365#20220402 - Germany - Leipzig', 6),
