(225, '2022-08-30 09:25:18', 'The Eurasian nuthatch or wood nuthatch (Sitta europaea) is a small passerine bird found throughout the Palearctic and in Europe, where its name is the nuthatch. Like other nuthatches, it is a short-tailed bird with a long bill, blue-grey upperparts and a black eye-stripe. It is a vocal bird with a repeated loud dwip call. There are more than 20 subspecies in three main groups; birds in the west of the range have orange-buff underparts and a white throat, those in Russia have whitish underparts, and those in the east have a similar appearance to European birds, but lack the white throat.', 'https://live.staticflickr.com/65535/52530619827_e7754284eb_o.jpg', 'https://live.staticflickr.com/65535/52530619827_fff190b413.jpg', '56.228853', '10.584983', 'SonyLeo', 'Sitta europaea', 221),
(226, '2022-08-18 14:13:56', 'Cmentarz wojenny nr 257, Biskupice Radłowskie, 18 sierpnia 2022 r.\nOddalony o kilkaset metrów od <a href=\"https://www.flickr.com/photos/iks_berto/52379234599/\">cmentarza nr 258</a>, cmentarz ten także zaprojektował Johann Watzal. Ma on kształt owalny, ze zbiorową mogiłą w kształcie kurhanu w centrum, na niej znajduja się 4 krzyże. Pochowano tutaj 206 żołnierzy armii rosyjskiej.\nInne cmentarze z I wojny światowej: <a href=\"https://www.flickr.com/photos/iks_berto/22034963851/\">58</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22299799212/\">60</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21889024818/\">66</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21578462064/\">67</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6135995818/\">108</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22341052186/\">122</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22354013552/\">123</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19970633962/\">145</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19808910078/\">150</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948366078/\">158</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948367540/\">160</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948372358/\">161</a>, <a href=\"https://www.flickr.com/photos/iks_berto/20069305696/\">163</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6218078042/\">167</a>, <a href=\"https://www.flickr.com/photos/iks_berto/29524373720/\">168</a>, <a href=\"https://www.flickr.com/photos/iks_berto/49941853138/\">200</a>, <a href=\"https://www.flickr.com/photos/iks_berto/50975787396/\">208</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52377332519/\">251</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52373686412/\">256</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52379234599/\">258</a>, <a href=\"https://www.flickr.com/photos/iks_berto/51402159168/\">368</a>.\n**\nWorld War I cemetery No. 257, Biskupice Radłowskie, August 18, 2022\nLocated several hundred metres from the <a href=\"https://www.flickr.com/photos/iks_berto/52379234599/\">cemetery No. 258</a>, this cemetery is also planned by Johann Watzal. It has the oval layout with a mound-shaped mass grave with 4 crosses standing on it. 206 soldiers of the Russian army are buried here.\nOther World War I cemeteries: \n<a href=\"https://www.flickr.com/photos/iks_berto/22034963851/\">No. 58</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22299799212/\">No. 60</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21889024818/\">No. 66</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21578462064/\">No. 67</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6135995818\">No. 108</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22341052186/\">No. 122</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22354013552/\">No. 123</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19970633962/\">No. 145</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19808910078/\">No. 150</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948366078/\">No. 158</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948367540/\">No. 160</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948372358/\">No. 161</a>, <a href=\"https://www.flickr.com/photos/iks_berto/20069305696/\">No. 163</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6218078042/\">No. 167</a>, <a href=\"https://www.flickr.com/photos/iks_berto/29524373720/\">No. 168</a>, <a href=\"https://www.flickr.com/photos/iks_berto/49941853138/\">No. 200</a>, <a href=\"https://www.flickr.com/photos/iks_berto/50975787396/\">No. 208</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52377332519/\">No. 251</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52373686412/\">No. 256</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52379234599/\">No. 258</a>, <a href=\"https://www.flickr.com/phot