(227, '2020-09-23 13:54:15', 'Façade, Ufa. Founded in 1574 on the order by Czar Ivan the Terrible as a fortified outpost on the eastern border of the expanding Russian Empire, Ufa grew over four and a half centuries to become a large industrial city with a population of 1.1 million, the capital of Republic of Bashkortostan, Russia. Located on the top of a hill at the confluence of two rivers, it received the township status as early as 1586. It remained a relatively small settlement with a population around 5,000 until the beginning of the 19th century when the Scottish engineer William Heste developed its first master plan. Although few buildings survived from that time, the grid of streets in the modern-day Ufa downtown still reflects the old layout. In the beginning of the 20th century, Ufa had a population of 100,000 and continued to grow. After the discovery of rich oil deposits in Bashkortostan, refineries were built in Ufa making it one of the largest oil refining and petrochemical cluster in Europe. During WWII, hundreds of factories were relocated to Ufa from western parts of Russia, which only added to its importance as an industrial center. Many prominent people come from or lived in Ufa, including, among others, opera singer Fyodor Shalyapin, ballet dancer Rudolf Nureyev, Russian and American writer Sergei Dovlatov. Vladimir Lenin stayed here for a fortnight in 1900 with his wife, Nadezhda Krupskaya. Ufa is a prominent center of Russian Islam [September 24, 2020].', 'https://live.staticflickr.com/65535/52530944226_c991b10063_o.jpg', 'https://live.staticflickr.com/65535/52530944226_9fba88b9c0.jpg', '54.724751', '55.929121', 'Yuri Rapoport', 'Façade', 173),
