(238, '2022-02-16 16:29:07', 'Developed by the Sukhoi Design Bureau (JSC Sukhoi Company; ПАО «Компания „Сухой“) to 2007, the Sukhoy Supejet was the very first civil plane of this firm much more known by they military aircrafts as the Su-24, 25, 27, and now this rare plane operated only by russian airlines. The sanctions and the Special operation positively influenced  development of the variant NEO with the maximum share of Russian components including special version of new russian PD-8 turbojet engine instead of french SAM-146 using of that had downed perspective project.', 'https://live.staticflickr.com/65535/52531411313_54cda5510f_o.jpg', 'https://live.staticflickr.com/65535/52531411313_e9f179acf1.jpg', '59.787719', '30.315549', 'Cetus13', 'Rossiya goes to a mist. Sukhoi Superjet 100 (SSJ 100-95B) of the «Rossiya airlines» takes off from the Pulkovo international airport (LED) of St Petersburg', 237),
