(252, '2022-08-18 14:07:40', 'Cmentarz wojenny nr 258, Biskupice Radłowskie, 18 sierpnia 2022 r.\nPołożony wśród pól cmentarz ma kształt ośmiokąta, zaprojektował go Johann Watzal. W środku umieszczony jest 11-metrowy obelisk. Znajduje się tu 30 mogił zbiorowych i 61 pojedynczych, w których pochowanych jest 329 żołnierzy armii austro-węgierskiej, 48 żołnierzy armii rosyjskiej i 17 żołnierzy niemieckich.\nInne cmentarze z I wojny światowej: <a href=\"https://www.flickr.com/photos/iks_berto/22034963851/\">58</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22299799212/\">60</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21889024818/\">66</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21578462064/\">67</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6135995818/\">108</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22341052186/\">122</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22354013552/\">123</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19970633962/\">145</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19808910078/\">150</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948366078/\">158</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948367540/\">160</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948372358/\">161</a>, <a href=\"https://www.flickr.com/photos/iks_berto/20069305696/\">163</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6218078042/\">167</a>, <a href=\"https://www.flickr.com/photos/iks_berto/29524373720/\">168</a>, <a href=\"https://www.flickr.com/photos/iks_berto/49941853138/\">200</a>, <a href=\"https://www.flickr.com/photos/iks_berto/50975787396/\">208</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52377332519/\">251</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52373686412/\">256</a>, <a href=\"https://www.flickr.com/photos/iks_berto/51402159168/\">368</a>.\n**\nWorld War I cemetery No. 258, Biskupice Radłowskie, August 18, 2022\nThe cemetery lies along the fields. It was designed by Johann Watzal on the octagonal plan. In the center stands a 11-metre-tall obelisk. There are 30 mass and 61 single graves for 329 soldiers of the Austro-Hungarian army, 48 soldiers of the Russian army and 17 German soldiers.\nOther World War I cemeteries: \n<a href=\"https://www.flickr.com/photos/iks_berto/22034963851/\">No. 58</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22299799212/\">No. 60</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21889024818/\">No. 66</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21578462064/\">No. 67</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6135995818\">No. 108</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22341052186/\">No. 122</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22354013552/\">No. 123</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19970633962/\">No. 145</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19808910078/\">No. 150</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948366078/\">No. 158</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948367540/\">No. 160</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948372358/\">No. 161</a>, <a href=\"https://www.flickr.com/photos/iks_berto/20069305696/\">No. 163</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6218078042/\">No. 167</a>, <a href=\"https://www.flickr.com/photos/iks_berto/29524373720/\">No. 168</a>, <a href=\"https://www.flickr.com/photos/iks_berto/49941853138/\">No. 200</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52373686412/\">No. 256</a>, <a href=\"https://www.flickr.com/photos/iks_berto/50975787396/\">No. 208</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52377332519/\">No. 251</a>, <a href=\"https://www.flickr.com/photos/iks_berto/51402159168/\">No. 368</a>.', 'https://live.staticflickr.com/65535/52379234599_82f6eecf96_o.jpg', 'https://live.staticflickr.com/65535/52379234599_78f2bc4cf2.jpg', '50.115967', 