(253, '2022-11-28 14:02:49', 'Россия.\nВечер в Старой Руссе.\nВознесенский собор.\n\nRussia.\nEvening in Staraya Russa.\nChurch of the Resurrection of Christ.\n', 'https://live.staticflickr.com/65535/52529615823_dba4aba0fd_o.jpg', 'https://live.staticflickr.com/65535/52529615823_dd34917cee.jpg', '57.989260', '31.353263', 'vdirenko', '221128-140249_Старая Русса', 708),
(254, '2013-07-16 20:24:46', 'Duke of Leuchtenberg revenue house, Saint Petersburg. Built in 1905 to the design by Theodore de Postels, the house is one of the most unusual examples of St. Pete Art Nouveau architecture. Mosaic-clad frieze depicting cityscapes and landscapes is a standout feature but other decoration details are of note, too. The entrance door has two bizarre-shaped solar-like circles at each side and two flying female figures on top. Ceramic tiles incorporated in the balconies resemble the trencadis technique extensively used by Gaudi. On the whole, the contrast between a regular window grid and soft, flowing sculpted decoration adds to the unique style of the building. Saint Petersburg, an ambitious urban project by Peter the Great, was founded as a new Baltic Sea port in 1703. The northernmost metropolis in the world, Saint Petersburg is often called the Venice of the North or the Russian Venice due to its many water corridors, as the city is built on swamp and water. Furthermore, it has strongly Western European-inspired architecture and culture, which is combined with the city\'s Russian heritage. Peter and his wife, the future Empress Catherine I, moved their courts to the new capital as early as 1712 when the city received the capital status. Saint Petersburg is known as the ‘Cultural Capital of Russia’ and had over 15 million tourists in 2018. It is considered an important economic, scientific, cultural, and tourism center of Russia and Europe [July 16, 2013]. ', 'https://live.staticflickr.com/65535/52528443352_363d061b46_o.jpg', 'https://live.staticflickr.com/65535/52528443352_d75638f9b2.jpg', '59.964201', '30.286216', 'Yuri Rapoport', 'Leuchtenberg House', 196),
