est railroad in the United States, was built in 1830 and cemented Baltimore\'s status as a major transportation hub, giving producers in the Midwest and Appalachia access to the city\'s port. Baltimore\'s Inner Harbor was once the second leading port of entry for immigrants to the United States. In addition, Baltimore was a major manufacturing center. After a decline in major manufacturing, heavy industry, and restructuring of the rail industry, Baltimore has shifted to a service-oriented economy. Johns Hopkins Hospital and Johns Hopkins University are the city\'s top two employers. Baltimore and its surrounding region are home to the headquarters of a number of major organizations and government agencies, including the NAACP, ABET, the National Federation of the Blind, Catholic Relief Services, the Annie E. Casey Foundation, World Relief, the Centers for Medicare &amp; Medicaid Services, and the Social Security Administration. Baltimore is also home to the Baltimore Orioles of Major League Baseball and the Baltimore Ravens of the National Football League.\n\nMany of Baltimore\'s neighborhoods have rich histories. The city is home to some of the earliest National Register Historic Districts in the nation, including Fell\'s Point, Federal Hill, and Mount Vernon. These were added to the National Register between 1969 and 1971, soon after historic preservation legislation was passed. Baltimore has more public statues and monuments per capita than any other city in the country. Nearly one third of the city\'s buildings (over 65,000) are designated as historic in the National Register, which is more than any other U.S. city. Baltimore has 66 National Register Historic Districts and 33 local historic districts.  The historical records of the government of Baltimore are located at the Baltimore City Archives.&quot; - info from Wikipedia. \n\nThe fall of 2022 I did my 3rd major cycling tour. I began my adventure in Montreal, Canada and finished in Savannah, GA. This tour took me through the oldest parts of Quebec and the 13 original US states. During this adventure I cycled 7,126 km over the course of 2.5 months and took more than 68,000 photos. As with my previous tours, a major focus was to photograph historic architecture. \n\nNow on <a href=\"https://www.instagram.com/billyd.wilson/\" rel=\"noreferrer nofollow\">Instagram</a>.\n\nBecome a patron to my photography on <a href=\"https://www.patreon.com/billywilson\" rel=\"noreferrer nofollow\">Patreon</a>. ', 'https://live.staticflickr.com/65535/52527592239_065d68e25c_o.jpg', 'https://live.staticflickr.com/65535/52527592239_1bf3db3ce2.jpg', '39.281828', '-76.593514', 'Billy Wilson Photography', 'No. 1645 Thames Street, Fells Point, Baltimore, Maryland, United States', 293),
