(334, '2022-11-25 08:17:01', 'Constantin Alajálov (1900-1987) lived a life filled with adventure, travel, ups, downs, failures, and successes. He rose from Russian revolutionary refugee to the heights of the New York art world.  He was a global citizen, having traveled much of the world before the middle of the 20th century. His extensive travels were a feat for the time period. \n\nHis first Post cover illustration appeared on October 6, 1945. By this time, Constantin Alajálov had made quite a name for himself in the commercial illustration industry. He had already provided cover work for magazines such as “Vanity Fair,” “Town and Country,” “Fortune,” “Life,” “Harper’s Bazaar,” “Vogue,” and “House &amp; Garden.”  His work was so sought after that he was placed in the unique situation of overcoming traditional contract exclusivity between “The New Yorker” and “The Saturday Evening Post.”  [Source: The Saturday Evening Post Archive]\n', 'https://live.staticflickr.com/65535/52524266767_7d2be88f2e_o.jpg', 'https://live.staticflickr.com/65535/52524266767_cf3f539c5f.jpg', '38.833213', '-77.114281', 'lhboudreau', '“Engagement Ring” by Constantin Alajálov on the cover of “The Saturday Evening Post,” May 7, 1949.', 596),
