(352, '2027-02-09 13:37:02', 'Sinónimos: Crula mandshurica (Maxim.) Nieuwl.; Acer kansuense W.P.Fang &amp; C.V.Chang; Negundo manshuricum Budishchev.\nArbusto o arbolito caducifolio de hasta 5 m de alto, a veces bastante mayor. Hojas trifolioladas, con foliolos oblongo lanceolados, de 5-10 cm de largo por 2,5-3 cm de ancho, acuminados, margen obtuso serrado, haz verde oscuro, envés verde azulado, peciolos de 4-5 cm de largo. Flores verde amarillentas, pentámeras, masculinas y femeninas separadas, en inflorescencias de 3. Sámaras erctas, de 3 cm de largo, con alas horizontales. Corteza lisa. Color otoñal rojo, muy precoz en el otoño. Especie nativa desde el sur del extremo este de Rusia hasta el norte de China y Corea. En Iturraran se encuentra en la zona 1.\n\nSynonyms: Crula mandshurica (Maxim.) Nieuwl.; Acer kansuense W.P.Fang &amp; C.V.Chang; Negundo manshuricum Budishchev.\nDeciduous shrub or small tree, up to 10m in height, sometimes considerably larger. Leaves trifoliolate, with leaflets oblong lanceolate, 5 - 10 cm in length by 2.5 - 3 cm wide, acuminate, margin obtuse serrate, adaxially dark green, abaxially bluish green, petioles 4 - 5 cm in length. Flowers yellowish-green, pentamerous, male and female separated, in inflorescences of 3. Samaras erect, 3 cm in length, with horizontal wings. Smooth bark. Autumn colour red, very early in the autumn. Species native from S. Russian Far East to N. China and Korea. Found in Iturraran in area 1.', 'https://live.staticflickr.com/65535/52524322350_0583cf46bb_o.jpg', 'https://live.staticflickr.com/65535/52524322350_609ec445c0.jpg', '43.251626', '-2.156227', 'helicongus', 'Acer mandshuricum Maxim. 1867 (SAPINDACEAE).', 5),
