(478, '2022-11-27 10:51:39', 'Το Διεθνές Αεροδρόμιο Ελληνικού, ή απλά Ελληνικό, ήταν το διεθνές αεροδρόμιο της Αθήνας για πάνω από 60 χρόνια. Οι διάδρομοί του κάποτε έσφυζαν από ζωή και υποδέχονταν τουρίστες από όλο τον κόσμο που ήθελαν να θαυμάσουν την Ελλάδα.\nΕίχε αρχίσει να χτίζεται το 1938 στην περιοχή Χασάνι, με διάδρομο 1.800 μέτρων, μετά την απαλλοτρίωση τμημάτων των τότε κοινοτήτων Κομνηνών και Ελληνικού. Ο Δεύτερος Παγκόσμιος Πόλεμος όμως δεν επέτρεψε την ολοκλήρωσή του.\n\nΑπό το 1945 έως το 1993, η ελληνική κυβέρνηση επέτρεψε τη χρήση του αεροδρομίου από τις Ηνωμένες Πολιτείες της Αμερικής. Γνωστό και ως αεροδρόμιο Hassani από το 1945, χρησιμοποιήθηκε από την Πολεμική Αεροπορία των ΗΠΑ ως βάση των επιχειρήσεων της Μονάδας Αεροπορικών Μεταφορών μεταξύ Ρώμης και Μέσης Ανατολής.\nΤο 1950 το αεροδρόμιο απέκτησε δεύτερο διάδρομο μήκους 2.250 μέτρων, ενώ ο πρώτος αυξήθηκε επίσης στα 2.250 μέτρα. Το 1958 ο κύριος διάδρομος επεκτάθηκε ξανά, με μήκος 3.000 μέτρα. Στις 30 Μαΐου 1962, ο Κωνσταντίνος Καραμανλής έθεσε τον θεμέλιο λίθο του Ανατολικού Αεροδρομίου του Ελληνικού, σχεδιασμένο από τον διάσημο Αμερικανο-Φινλανδό αρχιτέκτονα Eero Saarinen. Τα εγκαίνια έγιναν το 1969.\n\nΣτη δεκαετία του 1970 ο κύριος διάδρομος επεκτάθηκε στα 3.500 μέτρα, ενώ το 1976 η ελληνική κυβέρνηση ανέθεσε σε Κοινοπραξία Aeroports de Paris και Αεροδρόμιο της Φρανκφούρτης να επιλέξει την κατάλληλη τοποθεσία για τη μεταφορά του αεροδρομίου. Η τοποθεσία που τελικά επιλέχθηκε ήταν τα Σπάτα, αλλά η κατασκευή αναβλήθηκε. Στη δεκαετία του 1990 το αεροδρόμιο εξυπηρετούσε από 10 έως 12 εκατομμύρια επιβάτες ετησίως.\n\nΤο τελευταίο αεροσκάφος που αναχώρησε από το αεροδρόμιο ήταν ένα Boeing 737 της Ολυμπιακής Αεροπορίας με προορισμό τη Θεσσαλονίκη. Μετά το κλείσιμό του το 2001, το αεροδρόμιο του Ελληνικού παραμένει κλειστό καθώς ο Νέος Διεθνής Αερολιμένας «Ελευθέριος Βενιζέλος» είναι πλέον το κεντρικό αεροδρόμιο της Αθήνας.\n\nΤον Απρίλιο του 2011, άνοιξε το Μουσείο των Ολυμπιακών Αερογραμμών στον δυτικό τερματικό σταθμό, με τρία αεροσκάφη, τα οποία ήταν σταθμευμένα εκεί από το κλείσιμο του αεροδρομίου.\n\nΜετά το κλείσιμό του, στο αεροδρόμιο - λόγω των Ολυμπιακών Αγώνων του 2004 - κατασκευάστηκαν δύο γήπεδα μπέιζμπολ χωρητικότητας 8.700 και 4.000 θέσεων το καθένα, ένα Canoe-Kayak Slalom Center, ένα κλειστό γήπεδο 14.100 θέσεων και μια αίθουσα Ξιφασκίας 5.000 θέσεων. Επίσης, εκεί κατασκευάστηκε σιδηροδρομικός σταθμός για το τραμ της Αθήνας και τον ΟΑΣΑ (ΕΘΕΛ). Επίσης, στις εγκαταστάσεις του πρώην αεροδρομίου στεγάζεται και η Εθνική Μετεωρολογική Υπηρεσία, καθώς και τα Κέντρα Ελέγχου Εναέριας Κυκλοφορίας, Περιφέρεια Αθηνών και Μακεδονίας της Υπηρεσίας Πολιτικής Αεροπορίας.\nΛόγω της αδύναμης φύλαξής του, σχεδόν κάθε κτίριο έχει λεηλατηθεί. Σήμερα, στον χώρο του αεροδρομίου έχει στηθεί ανεπίσημος προσφυγικός καταυλισμός. Οι πρόσφυγες είναι περίπου 4.000.\n\nΟ «Olympic Eagle» (SX-OAB) είναι το μοναδικό Olympic 747 σε ελληνικό έδαφος.\n\nΤο αεροσκάφος φαίνεται σήμερα στη νοτιοανατολική πλευρά του πρώην αεροδρομίου του Ελληνικού. Κατασκευάστηκε το 1973 στις ΗΠΑ και παρελήφθη καινούργιο τότε από την Olympic Aviation. Μπορούσε να φιλοξενήσει συνολικά 426 επιβάτες και χωριζόταν σε δύο θέσεις: Business Class και Economy. Αυτό το αεροσκάφος έχει ένα ιδιαίτερο χαρακτηριστικό που το ξεχωρίζει από τα 747 άλλων εταιρειών: το αρχαιοελληνικό στοιχείο διατηρείται έντονα μέσα. Έτσι, η καμπίνα του αεροσκάφους χωρίστηκε σε «ζώνες», καθεμία από τις οποίες έχει ένα όνομα από μέρη της Ακρόπολης των Αθηνών. Για παράδειγμα, η Ζώνη Α ονομαζόταν «Προπύλαια», η Ζώνη Β «Ερεχτέον», η Ζώνη Γ «Παρθενώνας» κ.ο.κ.\n\nΓενικά η καμπίνα των επιβατών διατηρείται σε καλή κατάσταση σήμερα και μάλιστα μέσα σε αυτήν έχουν γυριστεί κάποιες ελληνικές σειρές. Δυστυχώς, δεν ισχύει το ίδιο για το πιλοτήριο. Λόγω ανεπαρκούς φύλαξης του αεροσκάφους τα προηγούμενα χρόνια, έχουν κλαπεί αρκετά πολύτιμα όργανα.\n\nΠηγή: <a href=\"http://www.lifo.gr\" rel=\"noreferrer nofollow\">www.lifo.gr</a>\n\nElliniko International Airport, or simply Elliniko, was the international airport of Athens for over 60 years. Its corridors were once bustling with life and welcomed tourists from all over the world who wanted to admire Greece.\nIt had begun to be built in 1938 in the Hassani area, with a runway of 1,800 meters, after the expropriation of parts of the then communities of Komnini and Hellinikon. The Second World War, however, did not allow its completion.\n .\nFrom 1945 to 1993, the airport was allowed by the Greek Government to be used by the United States of America. Also known as Hassani Airport since 1945, it was used by the US Air Force as a base of Air Transport Unit operations between Rome and the Middle East.\nIn 1950, the airport acquired a second runway with a length of 2,250 meters, while the first one was also increased to 2,250 meters. In 1958 the main runway was extended again, with a length of 3,000 meters. On May 30, 1962, Konstantinos Karamanlis laid the foundation stone of Hellinikon East Airport designed by the famous American-Finnish architect Eero Saarinen. The inauguration took place in 1969.\n .\nIn the 1970s the main runway was lengthened to 3,500 meters, while in 1976 the Greek Government commissioned a Consortium of Aeroports de Paris and Frankfurt Airport to select a suitable location for the transfer of the airport. The site finally chosen was Spata, but construction was postponed. In the 1990s the airport served between 10 and 12 million passengers a year.\n\nThe last aircraft to depart from the airport was an Olympic Airlines Boeing 737 bound for Thessaloniki. After its closure in 2001, Ellinikos Airport remains closed as the New International Airport &quot;Eleftherios Venizelos&quot; is now the central airport of Athens.\n\nIn April 2011, the Olympic Airlines Museum opened in the west terminal, featuring three aircraft, which have been parked there since the airport\'s closure.\n\nAfter its closure, at the airport - due to the 2004 Olympics - two baseball fields with a capacity of 8,700 and 4,000 seats each, a Canoe-Kayak Slalom Center, a 14,100-seat indoor court and a 5,000-seat Fencing Hall were built. Also, a train station for the Athens tram and OASA (ETHEL) was built there. Also, the National Meteorological Service is also housed in the premises of the former airport, as well as the Air Traffic Control Centers, Athens Region and Macedonia of the Civil Aviation Service.\nDue to its weak guarding, almost every building has been looted. Today, an unofficial refugee camp has been set up on the site of the airport. The refugees number approximately 4,000.\n \nThe &quot;Olympic Eagle&quot; (SX-OAB) is the only Olympic 747 on Greek soil.\n \n\nThe aircraft can be seen today on the southeast side of the former Hellinikon Airport. It was built in 1973 in the USA and received new then by Olympic Aviation. It could accommodate a total of 426 passengers and was divided into two seats: Business Class and Economy. This aircraft has a special feature that sets it apart from the 747s of other companies: the ancient Greek element is strongly kept alive inside. Thus, the aircraft cabin was divided into &quot;zones&quot;, each of which has a name from parts of the Acropolis of Athens. For example, Zone A was called &quot;Propylaia&quot;, Zone B &quot;Erechteon&quot;, Zone C &quot;Parthenon&quot; and so on.\n\nIn general, the passenger cabin is kept in good condition today, and in fact some Greek series have been filmed inside it. Unfortunately, the same is not true for the cockpit. Due to insufficient guarding of the aircraft in previous years, several valuable instruments have been stolen.\n\nSource: <a href=\"http://www.lifo.gr\" rel=\"noreferrer nofollow\">www.lifo.gr</a>', 'https://live.staticflickr.com/65535/52530083781_f5804840c8_o.jpg', 'https://live.staticflickr.com/65535/52530083781_5f6bbcd7a2.jpg', '37.879627', '23.744102', 'st.delis', 'Abandoned aircrafts of Olympic Airways... (Boeing 727-284, Boeing 737-284, Boeing 747-200)', 208),
