(746, '2022-08-09 15:46:54', 'ChS7 are the next and the last in line of 8-axle two-sections articulated 3kV DC electric passenger locomotives designed and built by Škoda Works in Czechoslovakia and later in Czechia for railways of Soviet Union. After a small series of powerfull and fastest (8 x 1000 kW, peak 8400 kW totally, 220 max. speed) ChS200 locomotives (12 ones built at 1974-79) and equivalently powered but more slower (190 km/h max) ChS6 passenger locomotives (30 ones for 1979-81) this locomotive strangely obtained less powered motors (8 x 770 kW) but improved electrical circiuts and were built by biggest seria of 321 ones from 1983 to 1997. Today the biggest part of locomotives are used by the Moscow Railway division of Russian Railways. Some are used in Ukraine.', 'https://live.staticflickr.com/65535/52532163784_df562967a3_o.jpg', 'https://live.staticflickr.com/65535/52532163784_d50178f79b.jpg', '55.778290', '37.657828', 'Cetus13', 'ChS7 (ЧС7-236) electric locomotive arrives on a Yaraslavl Railway terminal of Moscow with passenger train Vorkuta - Moscow', 294),
(747, '2022-08-09 15:47:35', 'ChS7, next and the last in line of 8-axle two-section 3kV DC electric passenger locomotives designed and built by Škoda Works in Czechoslovakia and later in Czechia for railways of Soviet Union. After a small series of powerfull and fastest (8 x 1000 kW, peak 8400 kW totally, 220 max. speed) ChS200 locomotives (12 ones built at 1974-79) and equivalently powered but more slower (190 km/h max) ChS6 passenger locomotives (30 ones for 1979-81) this locomotive strangely obtained less powered motors (8 x 770 kW) but improved electrical circiuts and were built by biggest seria of 321 ones from 1983 to 1997. Today the biggest part of locomotives are used by the Moscow Railway division of Russian Railways. Some are used in Ukraine.', 'https://live.staticflickr.com/65535/52531412827_2fb51a6f9c_o.jpg', 'https://live.staticflickr.com/65535/52531412827_50eb09207a.jpg', '55.778290', '37.657828', 'Cetus13', 'ChS7 (ЧС7-236) DC electric passenger locomotive made by Škoda', 227);
