(748, '2022-11-17 21:59:26', '17-November-2022\n\nThe return of the rains (sigh of relief) has lowered the temperatures and with them the consequential condensation of the mild maritime air.\n\nNow the Bora winds are strengthening and temperatures continue to drop; it seems that the march towards winter, thanks also to the precious return, to the &quot;isobaric scene&quot;, of the &quot;Russian-Scandinavian Anticyclone/HP&quot;, is being channeled on the right track.\n\nI hope...\n', 'https://live.staticflickr.com/65535/52531281362_59afa1f32c_o.jpg', 'https://live.staticflickr.com/65535/52531281362_01bd298c8d.jpg', '45.608948', '13.741643', 'stefano zerauschek', 'From Sultry October to Misty November Is a First Step into Meteorological Autumn; Muggia Seafront, Trieste Gulf Waterfronts, FVG, Italia', 286),
(749, '1916-03-06 00:00:00', 'Size 8.8 cm x 13.9 cm\n\nCard penned by soldier Stork in Russia to his children in Lengerich on 6.3.1916. Stork was soldier in Reserve Infanterie Regiment Nr. 218.\n\n01211_00000_FPP_01', 'https://live.staticflickr.com/65535/52531307092_d7e92f7cc1_o.jpg', 'https://live.staticflickr.com/65535/52531307092_dfa0b46130.jpg', '52.189712', '7.853507', 'bw-collector', 'Patriotic postcard from Russia to Lengerich', 125),
(750, '2022-11-29 09:17:09', 'Reverse\n\nTranscription:\n\nFeld-Postkarte\n\nAn\nFrau H. Stork\npr. Andr. Mietenkorte \nIntrup 5.a.\nin Lengerich i. / Westf(alen).\nKreis Te(c)klenburg\n\nAbsender:\nWehrm(ann). Stork\nReser(ve). Reg(imen)t. 2/218.\n\nRußland den 6.3.16.\n\nLiebe Anna u(nd). Willi\nHoffentlich seid Ihr noch gesund\nwelches bei mir auch noch der\nfall ist. Habe Deine Karte erhalten\nauch die aus Münster(.) Könnten\nwir doch wieder alle zusammen\nsein(.) Hoffentlich dauert es nicht\nmehr lange. Nun seid herzlich \ngegrüßt von Euren lieben \nVater. Auf Wiedersehen.\n\n01211_00000_FPP_01', 'https://live.staticflickr.com/65535/52531778181_86a544feb5_o.jpg', 'https://live.staticflickr.com/65535/52531778181_31dd55820a.jpg', '52.189712', '7.853507', 'bw-collector', 'Patriotic postcard from Russia to Lengerich', 43),
(751, '2022-11-25 23:44:18', 'Michael Louis Johnson is a foremost a trumpet/ cornet player. I have seen him perform 3x in November 2022, but always in slightly different role. He arrived in Toronto few decades ago to be an actor. He leads several bands, but on the night at Redwood Theatre he introduced a new swing band. Every Saturday afternoon he is in a small club, where he is the singing bartender, playing his trumpet, telling stories from his life, introducing songs he has written, greeting every guest like a old friend and of course mixing and serving drinks. He sings in English, French and even in passable Russian. He can make up song on a spot, if audience suggests to him a word or a sentence. To see him perform is always a treat. The drummer is Agneya Chikte and young musician whom I first met in 2017.\n\n156. Toronto P1470700; Taken 2022 Nov 25. Upload 2022 Nov 29.\n\n\n', 'https://live.staticflickr.com/65535/52532234188_bb1f175460_o.jpg', 'https://live.staticflickr.com/65535/52532234188_7255b8f18e.jpg', '43.671291', '-79.327254', 'toropano', 'Michael the Multitasker. Michael Louis Johnson at Redwood Theatre.', 435),
(752, '2022-04-02 16:24:06', '092/365#20220402 - Germany - Leipzig: Russian Memorial Church. The church is a free replica of the Church of the Resurrection in Moscow-Kolomenskoye, built in 1530-1532. It serves to commemorate the 22,000 Russian soldiers who fell in and around Leipzig during the Battle of the Nations in 1813.', 'https://live.staticflickr.com/65535/52531405824_37d1f92640_o.jpg', 'https://live.staticflickr.com/65535/52531405824_437b813ed2.jpg', '51.323969', '12.396780', 'Christian R. Rohleder', '092/365#20220402 - Germany - Leipzig', 6),
