(781, '2022-08-18 14:07:40', 'Cmentarz wojenny nr 258, Biskupice Radłowskie, 18 sierpnia 2022 r.\nPołożony wśród pól cmentarz ma kształt ośmiokąta, zaprojektował go Johann Watzal. W środku umieszczony jest 11-metrowy obelisk. Znajduje się tu 30 mogił zbiorowych i 61 pojedynczych, w których pochowanych jest 329 żołnierzy armii austro-węgierskiej, 48 żołnierzy armii rosyjskiej i 17 żołnierzy niemieckich.\nInne cmentarze z I wojny światowej: <a href=\"https://www.flickr.com/photos/iks_berto/22034963851/\">58</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22299799212/\">60</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21889024818/\">66</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21578462064/\">67</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6135995818/\">108</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22341052186/\">122</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22354013552/\">123</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19970633962/\">145</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19808910078/\">150</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948366078/\">158</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948367540/\">160</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948372358/\">161</a>, <a href=\"https://www.flickr.com/photos/iks_berto/20069305696/\">163</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6218078042/\">167</a>, <a href=\"https://www.flickr.com/photos/iks_berto/29524373720/\">168</a>, <a href=\"https://www.flickr.com/photos/iks_berto/49941853138/\">200</a>, <a href=\"https://www.flickr.com/photos/iks_berto/50975787396/\">208</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52377332519/\">251</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52373686412/\">256</a>, <a href=\"https://www.flickr.com/photos/iks_berto/51402159168/\">368</a>.\n**\nWorld War I cemetery No. 258, Biskupice Radłowskie, August 18, 2022\nThe cemetery lies along the fields. It was designed by Johann Watzal on the octagonal plan. In the center stands a 11-metre-tall obelisk. There are 30 mass and 61 single graves for 329 soldiers of the Austro-Hungarian army, 48 soldiers of the Russian army and 17 German soldiers.\nOther World War I cemeteries: \n<a href=\"https://www.flickr.com/photos/iks_berto/22034963851/\">No. 58</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22299799212/\">No. 60</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21889024818/\">No. 66</a>, <a href=\"https://www.flickr.com/photos/iks_berto/21578462064/\">No. 67</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6135995818\">No. 108</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22341052186/\">No. 122</a>, <a href=\"https://www.flickr.com/photos/iks_berto/22354013552/\">No. 123</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19970633962/\">No. 145</a>, <a href=\"https://www.flickr.com/photos/iks_berto/19808910078/\">No. 150</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948366078/\">No. 158</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948367540/\">No. 160</a>, <a href=\"https://www.flickr.com/photos/iks_berto/7948372358/\">No. 161</a>, <a href=\"https://www.flickr.com/photos/iks_berto/20069305696/\">No. 163</a>, <a href=\"https://www.flickr.com/photos/iks_berto/6218078042/\">No. 167</a>, <a href=\"https://www.flickr.com/photos/iks_berto/29524373720/\">No. 168</a>, <a href=\"https://www.flickr.com/photos/iks_berto/49941853138/\">No. 200</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52373686412/\">No. 256</a>, <a href=\"https://www.flickr.com/photos/iks_berto/50975787396/\">No. 208</a>, <a href=\"https://www.flickr.com/photos/iks_berto/52377332519/\">No. 251</a>, <a href=\"https://www.flickr.com/photos/iks_berto/51402159168/\">No. 368</a>.', 'https://live.staticflickr.com/65535/52379234599_82f6eecf96_o.jpg', 'https://live.staticflickr.com/65535/52379234599_78f2bc4cf2.jpg', '50.115967', '20.874997', 'magro_kr', 'Cmentarz wojenny nr 258', 0),
(782, '2022-11-28 14:02:49', 'Россия.\nВечер в Старой Руссе.\nВознесенский собор.\n\nRussia.\nEvening in Staraya Russa.\nChurch of the Resurrection of Christ.\n', 'https://live.staticflickr.com/65535/52529615823_dba4aba0fd_o.jpg', 'https://live.staticflickr.com/65535/52529615823_dd34917cee.jpg', '57.989260', '31.353263', 'vdirenko', '221128-140249_Старая Русса', 708),
(783, '2013-07-16 20:24:46', 'Duke of Leuchtenberg revenue house, Saint Petersburg. Built in 1905 to the design by Theodore de Postels, the house is one of the most unusual examples of St. Pete Art Nouveau architecture. Mosaic-clad frieze depicting cityscapes and landscapes is a standout feature but other decoration details are of note, too. The entrance door has two bizarre-shaped solar-like circles at each side and two flying female figures on top. Ceramic tiles incorporated in the balconies resemble the trencadis technique extensively used by Gaudi. On the whole, the contrast between a regular window grid and soft, flowing sculpted decoration adds to the unique style of the building. Saint Petersburg, an ambitious urban project by Peter the Great, was founded as a new Baltic Sea port in 1703. The northernmost metropolis in the world, Saint Petersburg is often called the Venice of the North or the Russian Venice due to its many water corridors, as the city is built on swamp and water. Furthermore, it has strongly Western European-inspired architecture and culture, which is combined with the city\'s Russian heritage. Peter and his wife, the future Empress Catherine I, moved their courts to the new capital as early as 1712 when the city received the capital status. Saint Petersburg is known as the ‘Cultural Capital of Russia’ and had over 15 million tourists in 2018. It is considered an important economic, scientific, cultural, and tourism center of Russia and Europe [July 16, 2013]. ', 'https://live.staticflickr.com/65535/52528443352_363d061b46_o.jpg', 'https://live.staticflickr.com/65535/52528443352_d75638f9b2.jpg', '59.964201', '30.286216', 'Yuri Rapoport', 'Leuchtenberg House', 196),
