h, GA. This tour took me through the oldest parts of Quebec and the 13 original US states. During this adventure I cycled 7,126 km over the course of 2.5 months and took more than 68,000 photos. As with my previous tours, a major focus was to photograph historic architecture. \n\nNow on <a href=\"https://www.instagram.com/billyd.wilson/\" rel=\"noreferrer nofollow\">Instagram</a>.\n\nBecome a patron to my photography on <a href=\"https://www.patreon.com/billywilson\" rel=\"noreferrer nofollow\">Patreon</a>. ', 'https://live.staticflickr.com/65535/52527591994_a8fcc4c297_o.jpg', 'https://live.staticflickr.com/65535/52527591994_f915c058e4.jpg', '39.281413', '-76.595091', 'Billy Wilson Photography', 'No. 845 South Bond Street, Fells Point, Baltimore, Maryland, United States', 218),
