(809, '2022-10-13 16:22:10', '&quot;The Robert Long House is a rowhouse in the Fell\'s Point neighborhood of Baltimore. The house is the oldest known surviving urban residence within the city of Baltimore, built in 1765. It was built as the home of Robert Long, a local Baltimore merchant, and today serves as the home of the Fells Point Preservation Society, who saved it from demolition in 1969 by purchasing it and restoring it.\n\nThe house is atypical of the surrounding area, with the architecture of the house matching that of homes built in the southern part of Pennsylvania where Long was born, rather than the standard rowhomes that make up the Fells Point neighborhood. The home was originally a two-story rowhome, with the third floor added sometime in the mid to late 1800s, covered with a mixture of tar and granite, known as &quot;flint coat&quot;.\n\nFell\'s Point is a historic waterfront neighborhood in southeastern Baltimore, Maryland. It was established around 1763 and is located along the north shore of the Baltimore Harbor and the Northwest Branch of the Patapsco River. The area has many antique, music and other stores, restaurants, coffee bars, a municipal markethouse with individual stalls, and over 120 pubs. Located 1.5 miles east of Baltimore\'s downtown central business district and the Jones Falls stream (which splits the city, running from northern Baltimore County), Fells Point has a maritime past and the air of a seafaring town. It also has the greatest concentration of drinking establishments and restaurants in the city.\n\nThe neighborhood has also been historically the home of large immigrant populations of Irish, Germans, Jews, Poles and other Eastern European nationalities such as Ukrainians, Russians, Czechs, and Slovaks, throughout its 250-year-old history. Since the 1970s, a steadily increasing number of middle- to upper-middle-income residents has moved into the area, restoring and preserving historic homes and businesses. Upper Fell\'s Point to the north along Broadway has gained a sizable Latino population, primarily from waves of Mexican and Central American immigrants since the 1980s, and is sometimes now called &quot;Spanish Town&quot;.\n\nThis Fells Point waterfront is an upscale residential area and tourist destination featuring first rate hotels and restaurants. It can be reached by water taxi barges, on foot as it is a very short walk from the Inner Harbor, and by bus or car. Fells Point is one of several areas in and around Baltimore that are listed on the National Register of Historic Places, (maintained by the National Park Service), the first designated from Maryland, and is one of the first registered historic districts in the United States to combine two separate waterfront communities (along with Federal Hill to the southwest across the Patapsco River and the Harbor on the &quot;Old South Baltimore&quot; peninsula of &quot;Whetstone Point&quot; at Fort McHenry).\n\nBaltimore (/ˈbɔːltɪmɔːr/ BAWL-tim-or, locally: /bɔːldəˈmɔːr/ bawl-da-MOR or /ˈbɔːlmər/ BAWL-mər) is the most populous city in the U.S. state of Maryland, fourth most populous city in the Mid-Atlantic, and the 30th most populous city in the United States with a population of 585,708 in 2020. Baltimore was designated an independent city by the Constitution of Maryland in 1851, and today is the most populous independent city in the United States. As of 2021, the population of the Baltimore metropolitan area was estimated to be 2,838,327, making it the 20th largest metropolitan area in the country. Baltimore is located about 40 miles (64 km) north northeast of Washington, D.C., making it a principal city in the Washington–Baltimore combined statistical area (CSA), the third-largest CSA in the nation, with a 2021 estimated population of 9,946,526.\n\nPrior to European colonization, the Baltimore region was used as hunting grounds by the Susquehannock Native Americans, who were primarily settled further northwest than where the city was later built. Colonists from the Province of Maryland established the Port of Baltimore in 1706 to support the tobacco trade with Europe, and established the Town of Baltimore in 1729. The first printing press and newspapers were introduced to Baltimore by Nicholas Hasselbach and William Goddard respectively, in the mid-18th century.\n\nThe Battle of Baltimore was a pivotal engagement during the War of 1812, culminating in the failed British bombardment of Fort McHenry, during which Francis Scott Key wrote a poem that would become &quot;The Star-Spangled Banner&quot;, which was eventually designated as the American national anthem in 1931. During the Pratt Street Riot of 1861, the city was the site of some of the earliest violence associated with the American Civil War.\n\nThe Baltimore and Ohio Railroad, the oldest railroad in the United States, was built in 1830 and cemented Baltimore\'s status as a major transportation hub, giving producers in the Midwest and Appalachia access to the city\'s port. Baltimore\'s Inner Harbor was once the second leading port of entry for immigrants to the United States. In addition, Baltimore was a major manufacturing center. After a decline in major manufacturing, heavy industry, and restructuring of the rail industry, Baltimore has shifted to a service-oriented economy. Johns Hopkins Hospital and Johns Hopkins University are the city\'s top two employers. Baltimore and its surrounding region are home to the headquarters of a number of major organizations and government agencies, including the NAACP, ABET, the National Federation of the Blind, Catholic Relief Services, the Annie E. Casey Foundation, World Relief, the Centers for Medicare &amp; Medicaid Services, and the Social Security Administration. Baltimore is also home to the Baltimore Orioles of Major League Baseball and the Baltimore Ravens of the National Football League.\n\nMany of Baltimore\'s neighborhoods have rich histories. The city is home to some of the earliest National Register Historic Districts in the nation, including Fell\'s Point, Federal Hill, and Mount Vernon. These were added to the National Register between 1969 and 1971, soon after historic preservation legislation was passed. Baltimore has more public statues and monuments per capita than any other city in the country. Nearly one third of the city\'s buildings (over 65,000) are designated as historic in the National Register, which is more than any other U.S. city. Baltimore has 66 National Register Historic Districts and 33 local historic districts.  The historical records of the government of Baltimore are located at the Baltimore City Archives.&quot; - info from Wikipedia. \n\nThe fall of 2022 I did my 3rd major cycling tour. I began my adventure in Montreal, Canada and finished in Savannah, GA. This tour took me through the oldest parts of Quebec and the 13 original US states. During this adventure I cycled 7,126 km over the course of 2.5 months and took more than 68,000 photos. As with my previous tours, a major focus was to photograph historic architecture. \n\nNow on <a href=\"https://www.instagram.com/billyd.wilson/\" rel=\"noreferrer nofollow\">Instagram</a>.\n\nBecome a patron to my photography on <a href=\"https://www.patreon.com/billywilson\" rel=\"noreferrer nofollow\">Patreon</a>. ', 'https://live.staticflickr.com/65535/52527591319_4ab0e89635_o.jpg', 'https://live.staticflickr.com/65535/52527591319_5581a06093.jpg', '39.282385', '-76.591250', 'Billy Wilson Photography', 'Robert Long House, Fells Point, Baltimore, Maryland, United States', 116),
