(814, '2015-07-26 13:40:28', 'MD/MUAH: Makhina\nPhotographer: <a href=\"http://www.romantikov.info/\" rel=\"noreferrer nofollow\">Kosya Romantikov</a>\nFull set in <a href=\"https://www.romantikov.info/?p=albums&amp;set=makhina_vdnh\" rel=\"noreferrer nofollow\">album</a>', 'https://live.staticflickr.com/65535/52527165893_c21fa620e7_o.jpg', 'https://live.staticflickr.com/65535/52527165893_3fb9ec380c.jpg', '55.831637', '37.638484', 'Kostya Romantikov', 'Photo-walk with Makhina', 3010),
(815, '2020-06-24 19:50:55', 'Am I a bum, bohemian or artist or everything mentioned a little bit? I officially worked in abandoned beverage factory Maraska as a security guard (from May 2020 until March 2021) but I never felt that it was a work, it was an honor and a pleasure to live in this historical building of Zadar city. Besides that it was first time in my life that indirectly I got paid for photography (holy shit). As I like to say it was one of my favorite period in life and perhaps pinnacle of my creativity. Believe it or not but I spent many nights with pleasure sleeping in the 109 years old reception (God bless the cozy vintage couch, it was my best friend during the night shifts). This working place didn’t had water, neither electricity nor toilette. Together with colleague little ol\' me used semi-legal solution to get electric power. My confrère bring electric cable about 20 meters that he plug from the reception to the “rusty” electric generation (long live ACϟDC). Electricity was very important for heater during the winter (to heat merciless “fat” walls of the building), but electric power was also crucial for listening vintage cassette player, it was all time switched on a local radio station 057 (on 91 Megahertz) that is located nearby across the sea from this deserted factory. Few times prehistoric reception leaked during the heavy rain but solution was to use plastic buckets in the floor above, thanks Mighty Lord that this good old penny-pinching trick à la Otto von Grunf worked. Such lifestyle remind me of a life of TNT, a poor gang from an Italian Alan Ford comic book. \n\nMany years dusty Maraska was a guest house to myriad of pigeons, I feel pity for them. Erelong this primeval beverage manufactory will be renewed and poor birds will lose a home. Maybe forsaken edifice should be called a Mike Tyson hotel (because he love pigeons). I admit it was beautiful experience exploring every mystical piece of this forgotten place. I woke up sometimes with the sound of sea waves &amp; seagulls and occasionally with noisy boat motors of catamaran Dora. I still remember strong south wind Jugo, this “culprit” broke the windows at some floors. From time to time I miss this Spooky House. Chucky was special guest, producer &amp; writer that often had crazy ideas for photo sessions. He broke windows on the first floor with his slingshot in one creative project to bring better atmosphere. Thanks Chuck you were right that broken windows will bring more artistic feeling in the style of a movie director Peter Hyams. This is it folks, see you next time, this was a letter without rhymes. Greetings from Wacky Chucky &amp; Yasha, with love from cold &amp; delightful Russia.\n\nP.s. This photo was taken on a precarious third floor. My idea was to carry the old closet to fill this empty huge space. I found closet in a room that was nearby on the same floor. Enjoy in a song from In Flames - Evil in a Closet.\n\n<a href=\"https://www.youtube.com/watch?v=A4RpS4kxO_4\" rel=\"noreferrer nofollow\">www.youtube.com/watch?v=A4RpS4kxO_4</a>\n\nP.P.S. Photo was explored on Flickr, place 336 / 500.\n\n', 'https://live.staticflickr.com/65535/52526959073_22a089c2f0_o.jpg', 'https://live.staticflickr.com/65535/52526959073_d179b3ba32.jpg', '44.122468', '15.226449', 'Master Of Pixels :o)', 'Bael\'s Business Meeting Room Inside The Palace Of Gloom (explore November 27th, 2022)', 6203),
