(818, '2022-09-19 23:09:01', 'Sitting on the overmantel in the sitting room is this rather charming piece of pottery which presumably records the Crimean War of 1853-6, in which Britain and France joined ranks to expel the invading Russian forces from the Ottoman Empire. Here we have the Sultan on the left, Queen Victoria in the middle, by her mid 30s at this date, and Napoleon III on the right. The war was a protracted affair, with notable battles at Sevastopol, Inkerman and Balaclava and, of course, the doomed charge of the Light Brigade in 1854, immortalised by Tennyson. It was the first major war to be fully documented in reports and even photographs, so those at home were very aware of the suffering of the troops and the efforts of those such as Florence Nightingale to prevent far more soldiers dying from infection or starvation than in battle. Eventually the allies were victorious and the Russian empire was seriously weakened. It couldn’t happen nowadays of course…\n', 'https://live.staticflickr.com/65535/52526639675_c7770c47c5_o.jpg', 'https://live.staticflickr.com/65535/52526639675_a1fe835936.jpg', '52.579977', '-2.154242', 'carolyngifford', 'Bantock House', 105),
