(888, '2022-10-16 14:07:55', 'IN ENGLISH BELOW THE LINE\n\nUna de les armes més iconiques del s. XX (i XXI), la ametralladora pesada russa-sovietica M1910 Maxim és inconfusible amb el seu carretó amb rodes incorporat.\n\nAquesta va ser trobada al entorn de la ruta de la retirada republicana del 1939 entre Camprodon i el Coll d\'Ares, ben oxidada, però conservant tots els elements caracteristics. Com diu el seu nom, fou una arma que es començà a produir el 1910 i formà part esencial de la I i II Guerres Mundials, la Guerra Civil Russa, la Guerra Civil espanyola, d\'on prové aquest exemplar, la Guerra de Corea i moltes altres. De fet, en aquests mateixos moments, diversos centenars estan en ús ben actual a la guerra d\'Ucraïna, en ambdós bandols (sembla que Ucraina mateixa en tenia en reserva 35000 unitats!!!).\n\nEm ve el record del cosí del meu pare, combatent de la lleva del biberó amb la 124 Brigada republicana (27 Divisió), que lluità al Ebre i el Segre amb ametralladores. Es veu que temporalment els hi varen donar Maxims, però ells preferiren &quot;màquines&quot; més lleugeres, d\'un model que encara no he aconseguit deduir (ell fa anys que és mort), però que seria: txecoslovaca, refrigerada per aigua, amb cinta i bipode o tripode. Com no fos una Mg08/15...\n\nAquesta dona la &quot;benvinguda&quot; al Museu de la Retirada de Camprodon, format per tota la ferralla abandonada pels boscos ripollesos aquell desgraciat 1939. No us el perdeu!\n\n<a href=\"https://en.wikipedia.org/wiki/PM_M1910\" rel=\"noreferrer nofollow\">en.wikipedia.org/wiki/PM_M1910</a>\n\n<a href=\"https://visitcamprodon.cat/que-fer/cultura-i-tradicions/museus/laretirada/\" rel=\"noreferrer nofollow\">visitcamprodon.cat/que-fer/cultura-i-tradicions/museus/la...</a>\n\n<a href=\"https://www.youtube.com/watch?v=vWv_hXunlkM\" rel=\"noreferrer nofollow\">www.youtube.com/watch?v=vWv_hXunlkM</a>\n\n<a href=\"https://www.youtube.com/shorts/kb5JTtoeQ50\" rel=\"noreferrer nofollow\">www.youtube.com/shorts/kb5JTtoeQ50</a>\n\n=====================\n\nOne of the most iconic weapons of the XX (and XXI) Centuries, the Russian-Soviet M1910 Maxim heavy machine gun is unmistakable with its built-in wheeled carriage.\n\nThis one was found around the route of the republican retreat of 1939 between Camprodon and the Coll d\'Ares, quite rusty, but retaining all the characteristic elements. As its name suggests, it was a weapon that began to be produced in 1910 and was an essential part of World Wars I and II, the Russian Civil War, the Spanish Civil War, where this specimen comes from, the Korean War and many others. In fact, at this very moment, several hundred are in current use in the Ukrainian war, on both sides (it seems that Ukraine itself had 35000 units in reserve!!!).\n\nI recall my father\'s cousin, a young soldier with the 124th Republican Brigade (27th Division), who fought in the Ebre and Segre (1938-39) with a MG company. It seems that they were temporarily given Maxims, but they preferred lighter &quot;machines&quot;, of a model that I still haven\'t been able to deduce (he\'s been dead for years so I will probably never know), but it would be: Czechoslovak, water-cooled, belt-feed and with a bipod or tripod. Maybe it was a Mg08/15, after all...\n\nThis one &quot;welcomes you&quot; to the Camprodon military museum &quot;La Retirada&quot;, made up of all the abandoned weapons by the Ripollese forests in that unfortunate 1939 winter.\n\n<a href=\"https://en.wikipedia.org/wiki/PM_M1910\" rel=\"noreferrer nofollow\">en.wikipedia.org/wiki/PM_M1910</a>\n\n<a href=\"https://visitcamprodon.cat/que-fer/cultura-i-tradicions/museus/laretirada/\" rel=\"noreferrer nofollow\">visitcamprodon.cat/que-fer/cultura-i-tradicions/museus/la...</a>\n\n<a href=\"https://www.youtube.com/watch?v=vWv_hXunlkM\" rel=\"noreferrer nofollow\">www.youtube.com/watch?v=vWv_hXunlkM</a>\n\n<a href=\"https://www.youtube.com/shorts/kb5JTtoeQ50\" rel=\"noreferrer nofollow\">www.youtube.com/shorts/kb5JTtoeQ50</a>', 'https://live.staticflickr.com/65535/52523874463_74d398eb96_o.jpg', 'https://live.staticflickr.com/65535/52523874463_ff376a708a.jpg', '42.311251', '2.365622', 'SBA73', 'Maxim, tant a Camprodon com a Ukraïna / The Maxim, found from Ukraine to Camprodon', 294),
(889, '2022-06-30 17:15:25', 'Vessels of the R-32A design (проект Р-32А; seria &quot;Nevsky-10-20&quot;) are the single-deck schalander with half-bottom, half-hull, open bunker in the middle part, high deckhouse and engine room in the supertructure at the stern.\n\nNevsky-13 (Невский-13) dry-cargo vessel (NEVSKIY 13 IMO:  8866204;  СЗ-02-38) was built at 1979 by the Nevsky shipbuilding and ship-repair plant (Shlisselburg, Leningrad region, Russia)\n\nRegister class: М-ПР2,5 (ЛЁД30)А\nOverall length, m: 99.5\nOverall width, m: 15.0\nOverhead clearance, m: 14.3\nBoard height, m: 4.3\nDisplacement, t: 3536\nDeadweight, t: 3360\nCarrying capacity, t: 3270\nLoad draught, m: 2.95-3.06\nEmpty draught, m: 0.86-1.89\nSpeed, km/h: 18.5 (laden); 20 (unladen)\nCrew accommodation: 10 (16 seats)\nAutonomy, days: 5\nType of main engine: 6NVD-48A-2U.\nPower: 2*566\nOwner and operator ЗАО «ЛСР - Базовые материалы Северо-Запад» \n\nMotor vessels of different variants of the &quot;Nevsky&quot; type (Pr. R-32, R-32A, R-32BU and R-32K) are the big dry-cargo ships with open bilge or hold compartment with hatch covers, with double boards and double bottom. Seria is named after place of birth or main working area - Neva river there the Nevsky shipbuilding and ship-repair plant is situated.  There are two main versions: with high superstructure in the stern part or with low deckhouse in the bow (for easy navigation under low bridges of Neva River). The last modification (pr. R-32K) are equipped with raising deckhouse in the bow. The superstructure on the ships of the initial project is low, with two squat chimneys, on the vessels of Project P-32A are high with one chimney. Modified ships (Pr. R-32BU) have increased power of machines, greater length of hull and tonnage, ice reinforcement of the hull. Several vessels received a closed hold, adapted for transportation of containers, including those on hatch covers.\n\nTotally 40 vessels of &quot;Nevsky&quot; type have been built since 1973 till 1994. Construction was executed by Nevsky vesselbuilding and vessel-repair plant (Russia, Shlisselburg). Initially they were delivered to North-Western Shipping Company for operation mainly on the Neva river, Ladoga and Onega lakes and in the Gulf of Finland of the Baltic Sea. Two vessels were built for work on the Dnepr. In the 90\'s, several vessels from the North-West Vesselping Company were sold to foreign companies, and others were bought for work on the Volga.\nAccording to websites fleetphoto.ru and riverfleet.ru\n\n\nTranslated with <a href=\"http://www.DeepL.com/Translator\" rel=\"noreferrer nofollow\">www.DeepL.com/Translator</a> (free version)', 'https://live.staticflickr.com/65535/52523145796_0f7b6bf85b_o.jpg', 'https://live.staticflickr.com/65535/52523145796_7399276fc6.jpg', '59.934745', '30.280777', 'Cetus13', 'Невский-13 (Nevskiy-13), variant of the Nevskiy project of dry cargoes with the deckhouse placed in the aft superstructure arrives to moor to the Lieutenant Schmidt embankment of St Petersburg', 595),
(890, '2022-09-22 09:20:26', 'Built in 1901-1903, this Russian Orthodox church was designed by Louis Sullivan for the congregation of St. Vladimir’s Russian Orthodox Church.  The church was founded by a group of Rusyn, Russian, Serbian, and Greek immigrants in 1892, who followed the Orthodox Christian faith, with the construction of the church being partially funded by Tsar Nicholas II and part of the work being donated by Louis Sullivan, along with a chandelier inside the church.  The church was consecrated by Bishop Tikhon, whom led the Russian Orthodox Church during the Russian Revolution, and was later canonized as a saint by the church.  In 1923, the church was elevated to the status of Cathedral, being renamed Holy Trinity Russian Orthodox Cathedral, today a cathedral affiliated with the Orthodox Church in America.\n\nThe church was modeled on vernacular rural churches in Russia, and features a stucco-clad exterior with an octagonal rotunda and dome at one end of the church, a semi-circular apse, golden onion domes atop lanterns on the tower and dome, a front tower with a multi-tiered octagonal open belfry, featuring Sullivanesque wood details and gables at the base of the octagonal roof, stained glass windows with decorative trim surrounds featuring triangular trim panels above the centers of the windows and Sullivanesque carved panels lining the interior-facing surfaces of the openings, cantilevered gabled roofs above the windows on the rotunda and dome, a double front entry door with a decorative canopy above featuring an ornate Sullivanesque trim detail, curved roof, and a Russian Orthodox cross above, and a curved front gable parapet interrupted by the front tower.\n\nThe interior of the church features stained glass windows by Healy &amp; Millet, a chandelier by Healy &amp; Millet, which hangs from the interior of the dome, murals on the walls and ceiling, an Iconostasis in front of the apse, arches ringing the interior of the rotunda, red carpet and wood floors, and bare bulb light fixtures.\n\nAdjacent to the church stands the Holy Trinity Rectory, which is a simpler building with a front gable roof, stucco-clad exterior, second story front balcony and oriel window flanked by two sets of french doors, one-over-one windows, a doorway with an arched transom on the front facade, and decorative trim elements at the eaves, including dentils and coffers.\n\nThe building underwent an exterior renovation in 2021, restoring the exterior stucco and paint, returning the building’s exterior color scheme to the original colors that it was painted in 1903.  The church and rectory were listed on the National Register of Historic Places in 1976, and were designed a Chicago Landmark in 1979.', 'https://live.staticflickr.com/65535/52523222824_691d436675_o.jpg', 'https://live.staticflickr.com/65535/52523222824_211ac275db.jpg', '41.902000', '-87.682153', 'w_lemay', 'Holy Trinity Russian Orthodox Cathedral, Leavitt Street and Haddon Avenue, Ukrainian Village, Chicago, IL', 68),
