(894, '2022-12-01 06:34:42', 'A very interesting trip to Auschwitz with Michael', 'https://live.staticflickr.com/65535/52536179418_e66fd6b109_o.jpg', 'https://live.staticflickr.com/65535/52536179418_3da87bf137.jpg', '50.037208', '19.174738', '7erminatrontzou7', 'Auschwitz', 0),
(895, '2022-09-06 09:53:53', 'After Franco\'s victory over the Spanish Republic in Catalonia, about 90,000 republican Spaniards and members of the International Brigades were led from there to Saint-Cyprien in February 1939, where they were initially forced to camp under tarpaulins on the beach; among them were the Germans Kurt Goldstein and Erich Weinert. Most were later taken to other camps, e.g. the notorious Sahara camp Djelfa, the internment camp Gurs or the punishment camp Le Vernet d\'Ariège. From there, many were later deported to the concentration camps.\nFrom May 1940, between 4,400 and 8,000 people expelled to France by the Belgian authorities were interned in the camp, mostly German or Austrian Jews who had fled the Nazis or people who had been politically persecuted. They were treated by the Vichy government as suspicious, &quot;undesirable foreigners&quot; and their belongings were confiscated. Among them were the painters Felix Nussbaum (murdered in Auschwitz in 1944) and Carl Rabus (death by drowning in 1983) as well as the writer Jean Améry, who escaped from the camp (death by suicide in 1978). When the camp was closed at the end of 1940, 3870 mostly Jewish people were deported to the Gurs camp and many were later deported from there via the Drancy camp near Paris to the Auschwitz-Birkenau extermination camp. Other camps were set up along the coast in Argelès-sur-Mer and Agde.\nSaint-Cyprien Plage on the coast of Roussillon, Département Pyrénées-Orientales\nOccitanie, France 06.09.2022\n<a href=\"https://www.gedenkorte-europa.eu/content/list/141/\" rel=\"noreferrer nofollow\">www.gedenkorte-europa.eu/content/list/141/</a>\n<a href=\"https://www.akg-images.de/CS.aspx?VP3=SearchResult&amp;VBID=2UMES6QY76ZOD&amp;RW=1920&amp;RH=937#/SearchResult&amp;VBID=2UMES6QY76ZOD&amp;RW=1920&amp;RH=937&amp;POPUPPN=6&amp;POPUPIID=2UMDHUVH80BZ\" rel=\"noreferrer nofollow\">www.akg-images.de/CS.aspx?VP3=SearchResult&amp;VBID=2UMES...</a>\n<a href=\"https://www.yadvashem.org/yv/de/exhibitions/nussbaum/camp-synagogue.asp\" rel=\"noreferrer nofollow\">www.yadvashem.org/yv/de/exhibitions/nussbaum/camp-synagog...</a>\n\nSchatten der Vergangenheit am Strand von Saint-Cyprien\nNach dem Sieg Francos über die spanischen Republik in Katalonien wurden von dort im Februar 1939 etwa 90.000 republikanische Spanier und Mitglieder der Internationalen Brigaden nach Saint-Cyprien geleitet, wo sie zunächst unter Planen am Strand kampieren mussten; darunter waren u.a. die Deutschen Kurt Goldstein und Erich Weinert. Die meisten wurden später in andere Lager gebracht, z.B. in das berüchtigte Saharalager Djelfa, das Internierungslager Gurs oder das Straflager Le Vernet d\'Ariège. Von dort wurden später viele in die Konzentrationslager deportiert.\nAb Mai 1940 wurden zwischen 4400 und 8000 von den belgischen Behörden nach Frankreich ausgewiesene Menschen im Lager interniert, meist vor den Nazis geflohene deutsche oder österreichische Juden oder politisch Verfolgte. Sie wurden von der Vichy-Regierung als verdächtige, „unerwünschte Ausländer“ behandelt und ihre Habe konfisziert. Darunter waren u.a. die Maler Felix Nussbaum (1944 in Auschwitz ermordet) und Carl Rabus (1983 Tod durch Ertrinken) sowie der Schriftsteller Jean Améry, der aus dem Lager fliehen konnte (1978 Tod durch Suizid). Bei der Schließung des Lagers Ende 1940 wurden 3870 meist jüdische Personen in das Lager Gurs verschleppt und viele später von dort über das Lager Drancy bei Paris in das Vernichtungslager Auschwitz-Birkenau deportiert. Entlang der Küste waren weitere Lager in Argelès-sur-Mer und Agde eingerichtet.\nSaint-Cyprien Plage an der Küste des Roussillon, Département Pyrénées-Orientales\nOkzitanien, Frankreich 06.09.2022\n<a href=\"https://www.gedenkorte-europa.eu/content/list/141/\" rel=\"noreferrer nofollow\">www.gedenkorte-europa.eu/content/list/141/</a>\n<a href=\"https://www.akg-images.de/CS.aspx?VP3=SearchResult&amp;VBID=2UMES6QY76ZOD&amp;RW=1920&amp;RH=937#/SearchResult&amp;VBID=2UMES6QY76ZOD&amp;RW=1920&amp;RH=937&amp;POPUPPN=6&amp;POPUPIID=2UMDHUVH80BZ\" rel=\"noreferrer nofollow\">www.akg-images.de/CS.aspx?VP3=SearchResult&amp;VBID=2UMES...</a>\n<a href=\"https://www.yadvashem.org/yv/de/exhibitions/nussbaum/camp-synagogue.asp\" rel=\"noreferrer nofollow\">www.yadvashem.org/yv/de/exhibitions/nussbaum/camp-synagog...</a>', 'https://live.staticflickr.com/65535/52530573567_d613b8432d_o.jpg', 'https://live.staticflickr.com/65535/52530573567_5c115f1e2b.jpg', '42.629088', '3.036153', 'Wolfram Biermann-Zeitler', 'Shadows of the past on the beach of Saint-Cyprien', 102),
(896, '2022-11-27 09:58:13', 'En fait, je devais être au tout début du primaire, CE1 peut être CE2, mais peu importe.\nMa mère, au foyer, faisait souvent l’effort de nous emmener dans la forêt proche de notre immeuble. A l’époque, la forêt de Montgeon.\nCe qui n’est plus le cas ; même si le nom de « forêt de Montgeon » est resté. C’est, depuis bien longtemps, une sorte de zone récréative aménagée pour les Havrais en mal de verdure.\nBref, lorsque j’avais commencé à parler de ce que nous croisions durant nos promenades, ma mère avait été amusée dans un premier temps. Elle supposait que mon sens de l’humour ou mon imagination (voire les deux) étaient précoces. Et puis, quand elle comprit que je ne plaisantais pas ; que je n’inventais pas, elle s’inquiéta :\n- Mais enfin, nous n’avons pas rencontré ces bêtes là ! Et le géant… Tu inventes, arrête de mentir !\nCependant, il faut croire que ma sincérité et ma bonne foi évidente la persuadèrent que je disais la vérité, du moins, « ma vérité ».\nElle finit par en parler à mon père même si elle savait d’avance que ce n’était pas une très bonne idée. L’analyse de mon géniteur fut à l’image de sa tendresse filiale :\n- Il est zinzin ton fils ! Que veux tu que je te dise ? A force de le couver, ça ne m’étonne pas. Va voir le toubib mais c’est déjà trop tard, si tu veux mon avis.\nEt sous la recommandation paternelle, ma mère me traîna chez notre médecin de famille.\nJ’ai le souvenir d’un homme très âgé, doux et d’une grande gentillesse.\nLa seule chose qui ne manquait pas de me turlupiner à son égard, était ce tremblement prononcé qui l’affectait en permanence. A cette époque, l’hôpital était le recours pour les cas graves. Pour rien au monde, j’aurais voulu qu’il me recouse en cas d’accident ; certains de mes copains m’avaient décrit leur calvaire, étant passés dans ses mains agitées .\n«  C’est pire qu’Auschwitz », avait dit le grand Fernand qui était pourtant un dur à cuire. A l’époque, je ne comprenais pas bien ce que cela voulait dire mais ça ne présageait rien de bon.\n(... )', 'https://live.staticflickr.com/65535/52526694118_b2cd9c5ccc_o.jpg', 'https://live.staticflickr.com/65535/52526694118_b45c593afd.jpg', '50.844321', '-1.569499', 'jcois.', 'Je vois des choses... (Partie 1)', 145),
(897, '2022-04-12 07:36:58', 'In the leafy suburbs of Berlin lies Grunewald station on the S-Bahn network, which has been here since 1879. The station building is from 1899. \n\nThe station has a dark past, as it was one of the places in Berlin where deportation trains left, taking thousands of Jews to either ghettos in cities further east, or concentration camps such as Auschwitz-Birkenau and Theresienstadt. At least 17,000 left here for Auschwitz. \nIt wasn\'t until the 1980s that memorials began to appear here. \nGleis (Platform) 17 was where these deportation trains left from. It has been preserved as a memorial and people can freely walk around this site. ', 'https://live.staticflickr.com/65535/52507019748_a5aea3130c_o.jpg', 'https://live.staticflickr.com/65535/52507019748_79678d0bfa.jpg', '52.488575', '13.263738', 'Kent Explorer', 'Bahnhof Berlin-Grunewald, Gleis 17', 30),
