(905, '2022-11-13 14:23:31', 'Haja Roter-Tenenbaum né en Pologne en 1906, arrêtée et détenue à Malines le 6 février 1943 et déportée le 19 avril de la même année pour Auschwitz. Assassinée par les nazis', 'https://live.staticflickr.com/65535/52500231874_b48ca435f6_o.jpg', 'https://live.staticflickr.com/65535/52500231874_33439b659b.jpg', '50.858450', '4.366496', 'Damien Marcellin Tournay', 'Schaerbeek - rue de la chaumière, 41', 49),
