(907, '2022-09-15 11:21:59', '(Description board reads)\n\nSeveral hundred women prisoners, mainly Jewish, were held in two upstairs rooms of this block and used as human guinea pigs for sterilization experiments conducted by Prof. Dr Carl Clauberg from Aril 1943 to May 1944.  Some of them died from the treatment they received.  Others were murdered so that autopsies could be performed on them.  Other SS doctors also conducted experiments on women in this block. ', 'https://live.staticflickr.com/65535/52474922350_692f77f415_o.jpg', 'https://live.staticflickr.com/65535/52474922350_87830811e7.jpg', '50.038454', '19.223585', 'gravesVpelli', 'Auschwitz Camp: Block 10', 25),
