(909, '2022-09-15 10:22:51', '', 'https://live.staticflickr.com/65535/52474916910_992f50f1f4_o.jpg', 'https://live.staticflickr.com/65535/52474916910_d3b32c8dcb.jpg', '50.038454', '19.223585', 'gravesVpelli', 'Auschwitz Camp, Poland', 7),
(910, '1934-01-01 00:00:00', 'Charles Gesner van der Voort (1916-1991) was part of a group of Dutch bachelors in pre-war Shanghai. Another member of this group was David van Gelderen (1908-1990), originally from Rotterdam. He arrived in Shanghai in 1933, working for Unilever, a merger of the operations of Dutch Margarine Unie and British soap maker Lever Brothers.\n\nThe photo albums of his China years contain many photos of the bachelor life in those days: travel, work, parties, trips within China and to Japan. They also include photos of the bombing of the Unilever factory during the 1937 Japanese attack of Shanghai, membership of the French Special Police and other unique photos.\n\nLike Charles, David was interned in Chapei Civil Assembly Centre by the Japanese from 1943 to 1945. \nBeing Jewish, internment in Shanghai probably saved David’s life; since all of his family members in the Netherlands were killed by the Nazis. \n\nDavid married, had two children and continued to work for Unilever. He became member of Nederlandse Reünisten Vereniging China (NRVC, Dutch Reunists Association China).\n\n<a href=\"https://en.wikipedia.org/wiki/Kiautschou_Bay_Leased_Territory\" rel=\"noreferrer nofollow\">en.wikipedia.org/wiki/Kiautschou_Bay_Leased_Territory</a>\n&quot;On 15 August 1914, at the outbreak of World War I in Europe, Japan delivered an ultimatum to Germany demanding that it relinquish its control of the disputed territory of Kiaoutschou. Upon rejection of the ultimatum, Japan declared war on 23 August and the same day its navy bombarded the German territory. On 7 November 1914, the bay was occupied by Japanese forces (see Siege of Tsingtao). Following resolution of the Shandong Problem, the occupied territory was returned to China on 10 December 1922 but the Japanese again occupied the area from 1937 to 1945 during the Second Sino-Japanese War. &quot;\n\nA couple of days ago, 15 October 2022, a statue was placed for Enith Brigitha in Almere, near my home. She is an inspiration to many people, being the first black athlete to win a swimming medal in the Olympics.\n\n<a href=\"https://en.wikipedia.org/wiki/Enith_Brigitha\" rel=\"noreferrer nofollow\">en.wikipedia.org/wiki/Enith_Brigitha</a>\nEnith Sijtje Maria Brigitha (born 15 April 1955) is a former leading competitive swimmer in the 1970s. She twice represented the Netherlands at the Summer Olympics, starting in 1972 (Munich, West Germany). She won two bronze medals at the 1976 Summer Olympics in Montreal, Quebec, Canada, in the women\'s 100 m and 200 m freestyle. Brigitha twice was named \'Dutch Sportswoman of the Year\', in 1973 and 1974. She was the first black athlete to win a swimming medal in the Olympics.\n\nEast Germany doping controversy\nIn the 100m freestyle, Brigitha finished behind two swimmers from East Germany, a country proven to have engaged in systematic doping of its athletes in the Montreal 1976 Olympic games. As a result, other athletes have called for Brigitha to be officially awarded the gold in the 100m freestyle and silver in the 200m freestyle. Brigitha has said she considers herself a gold medal winner.\n\nAmerican Shirley Babashoff, who would have earned three individual golds were it not for the East Germans, has been outspoken about this issue. She supports Brigitha and swimmers from other countries who were adversely affected by the East German illegal practices.\n\nA book which inspired me today was by Takis Wuerger about Noah Klieger (1925-2018), who survived Auschwitz.\n\nCourtesy Van Gelderen family archives', 'https://live.staticflickr.com/65535/52438390932_f3b69deeb4_o.jpg', 'https://live.staticflickr.com/65535/52438390932_23be1bdfbe.jpg', '36.058293', '120.308189', 'Charles in Shanghai', 'Swimming at Kiautchau, Qingdao, 1934', 610),
(911, '2022-10-05 15:48:17', 'Called Hiwis, it was &quot;join the German army or starve&quot; in the brutal POW camps. We visited one in 2018, where 15,000 Soviet POWs died from maltreatment and gassing: Auschwitz.', 'https://live.staticflickr.com/65535/52433739878_4bf111075c_o.jpg', 'https://live.staticflickr.com/65535/52433739878_4a07042dc2.jpg', '49.372411', '-0.879712', 'Hubbard Family Vacations', 'The Americans faced the 352nd Infantry Division; other beaches were defended by unwilling conscripts from Soviet, Polish and Czech POWs.', 11),
(912, '2022-06-24 11:13:55', 'Arbeit macht frei gate\n\nAdmission to Auschwitz and Birkenau concentration camps and museum is free but reservation tickets are essential while <a href=\"https://www.european-traveler.com/poland/tips-on-buying-tickets-to-visit-auschwitz-and-booking-day-trip-tours/\" rel=\"noreferrer nofollow\">guided tours</a> are good options to visit with transportation from Krakow, Katowice, or Warsaw.', 'https://live.staticflickr.com/65535/52427251792_bdd87a3299_o.jpg', 'https://live.staticflickr.com/65535/52427251792_9820971328.jpg', '50.027580', '19.203280', 'Henk Bekker', 'Auschwitz Arbeit Macht Frei', 66),
(913, '2022-06-24 11:16:01', 'The famous Arbeit macht frei gate at Auschwitz I. This was the ultimate Nazi lie: although prisoners were set free from concentration camps such as Dachau and Sachsenhausen where the same sign was used during the 1930s, hard work was never the deciding factor.\n\nThe original sign was recently stolen and although recovered will only be displayed inside the museum in future.\n\nAdmission to Auschwitz and Birkenau concentration camps and museum is free but reservation tickets are essential while <a href=\"https://www.european-traveler.com/poland/tips-on-buying-tickets-to-visit-auschwitz-and-booking-day-trip-tours/\" rel=\"noreferrer nofollow\">guided tours</a> are good options to visit with transportation from Krakow, Katowice, or Warsaw.', 'https://live.staticflickr.com/65535/52428041824_cd736b104a_o.jpg', 'https://live.staticflickr.com/65535/52428041824_ea145ae9ae.jpg', '50.027472', '19.203336', 'Henk Bekker', 'Auschwitz - Arbeit Mach Frei', 48),
