(921, '2022-06-24 14:05:10', 'The wooden barracks at Auschwitz Birkenau were mostly destroyed at the end of the Second World War, however, many brick chimneys survived. I asked the tour guide (educator) why they had chimneys as the prisoners certainly didn\'t receive coal or wood for fires to warm the barracks? Her reply revealed the perversity of the whole system. Although these camps were erected to either kill people outright or work them to death, German building regulations still required that communal accommodation must have facilities to heat the buildings in winter. These regulations of course did not prescribed that the facilities had to be used but surely somebody with connections made a packet out of erecting these unused brick chimneys.\n\nAdmission to Auschwitz and Birkenau concentration camps and museum is free but reservation tickets are essential while <a href=\"https://www.european-traveler.com/poland/tips-on-buying-tickets-to-visit-auschwitz-and-booking-day-trip-tours/\" rel=\"noreferrer nofollow\">guided tours</a> are good options to visit with transportation from Krakow, Katowice, or Warsaw.', 'https://live.staticflickr.com/65535/52428267458_a359fa34d5_o.jpg', 'https://live.staticflickr.com/65535/52428267458_c3bee00a3f.jpg', '50.033291', '19.176711', 'Henk Bekker', 'Auschwitz II Birkenau', 47),
