(1142, '2022-11-01 10:52:51', 'Mr. Dato Lim Jock Hoi, Secretary General, ASEAN, Jakarta, Indonesia, speaks at the “Supercharging Economic Growth on the Strength of Intangibles” panel of the <a href=\"https://www.wipo.int/sme/en/events/high-level-conversation.html\" rel=\"noreferrer nofollow\">High-level Conversation on Unlocking Intangible Asset Finance</a>. \n\nMore: <a href=\"https://www.wipo.int/sme/en/news/2022/news_0018.html\" rel=\"noreferrer nofollow\">Inaugural High-level Conversation on Unlocking Intangible Asset Finance</a>\n\nHeld at WIPO headquarters in Geneva, Switzerland, on November 1, 2022, the event highlighted the potential of using intellectual property and other intangible assets to support finance, and served as an initial step towards building an international community focused on intangible asset finance. It featured expert panels, an interactive workshop, as well as networking opportunities among participants including business leaders, intellectual property and finance experts, from both public and private sectors.\n\nCopyright: WIPO. Photo: Emmanuel Berrod. This work is licensed under a <a href=\"https://creativecommons.org/licenses/by/4.0/\" rel=\"noreferrer nofollow\">Creative Commons Attribution 4.0 International License</a>.', 'https://live.staticflickr.com/65535/52470228638_c117820dc3_o.jpg', 'https://live.staticflickr.com/65535/52470228638_61965b23fe.jpg', '46.222474', '6.136894', 'WIPO | OMPI', 'High-level Conversation on Unlocking Intangible Asset Finance: Supercharging Economic Growth on the Strength of Intangibles', 150),
