(1186, '2022-10-06 00:00:00', 'FloodList - 7 Oct 2022 - Indonesia\nIndonesia – Deadly Floods in Jakarta, Thousands Evacuate in Aceh Province\nHeavy rain caused severe flooding in parts of Jakarta, capital of Indonesia, on 06 October 2022, where authorities report 3 people have died. Meanwhile over 18,000 people were forced from their homes after severe flooding in North Aceh Regency in Aceh Province.\nMore: <a href=\"https://floodlist.com/.../indonesia-floods-jakarta-aceh..\" rel=\"noreferrer nofollow\">floodlist.com/.../indonesia-floods-jakarta-aceh..</a>.\nMap: <a href=\"https://goo.gl/maps/PcNoQqpsQSdGFcQN9\" rel=\"noreferrer nofollow\">goo.gl/maps/PcNoQqpsQSdGFcQN9</a>\nImages:\n- Evacuations after floods in South Jakarta, Indonesia, 06 October 2022. Photo: BPBD DKI Jakarta\n', 'https://live.staticflickr.com/65535/52410923638_6776b709c0_o.jpg', 'https://live.staticflickr.com/65535/52410923638_b7ac010068.jpg', '-6.173664', '106.818008', 'Flood_List', 'Evacuations after floods in South Jakarta, Indonesia, 06 October 2022. Photo: BPBD DKI Jakarta', 18),
