(1282, '2022-09-03 14:47:32', 'Ports of Auckland, New Zealand\n\nThe vessel is currently at port AUCKLAND, NZ after a voyage of 16 days, 4 hours originating from port JAKARTA, ID.\n \n\nDANSHIP BULKER (IMO: 9515682) is a Bulk Carrier that was built in 2009 (13 years ago) and is sailing under the flag of Malta.\nIt’s carrying capacity is 28291 t DWT and her current draught is reported to be 6.6 meters. Her length overall (LOA) is 169.37 meters and her width is 27.2 meters.', 'https://live.staticflickr.com/65535/52330671078_9cbac3942f_o.jpg', 'https://live.staticflickr.com/65535/52330671078_2ab19c4003.jpg', '-36.840064', '174.779434', 'Kiwis 2', 'The Bulk Carrier Danship Bulker', 384),
