(1297, '2022-08-27 10:49:46', 'The old town of Semarang, called Kota Lama, was founded by the Dutch colonists through the VOC in the early 1700s. The old town contains numerous buildings dating from this time until the early 20th century. Similar to Kota Tua in Jakarta and Bandung, the old town contains many Art Deco buildings that reflect a mix of Dutch and tropical Indonesian designs.', 'https://live.staticflickr.com/65535/52315230690_18c5c3c08c_o.jpg', 'https://live.staticflickr.com/65535/52315230690_0fb4bfc557.jpg', '-6.968707', '110.425086', 'caspar40', 'Art Deco and motorcycles. Semarang old town (Java, Indonesia).', 531),
(1298, '2022-08-27 10:17:05', 'Taman Sari was a mid 18th century, fortified palace surounded inside and outside with water. It was a pleasure palace for the sultans of Yogjakarta, who rested, bathed, meditated, or watched women bathing there. It also housed workshops and had a defence function. \n\nThe founder of this palace was said to have visited Dutch colonial Batavia (modern Jakarta) to learn more from the European architecture. Taman Sari integrates neatly traditional Javanese, muslim, Chinese and Dutch architectural influences. Today it is still beautifully preserved.', 'https://live.staticflickr.com/65535/52313928892_9ec8142ac1_o.jpg', 'https://live.staticflickr.com/65535/52313928892_b0da7ab39d.jpg', '-7.809941', '110.359404', 'caspar40', 'Taman Sari or \"water palace\", Yogyakarta', 582),
(1299, '2022-08-27 10:17:02', 'Taman Sari was a mid 18th century, fortified palace surounded inside and outside with water. It was a pleasure palace for the sultans of Yogjakarta, who rested, bathed, meditated, or watched women bathing there. It also housed workshops and had a defence function. \nThe founder of this palace was said to have visited Dutch colonial Batavia (modern Jakarta) to learn more from the European architecture. Taman Sari integrates neatly traditional Javanese, muslim, Chinese and Dutch architectural influences. Today it is still beautifully preserved.', 'https://live.staticflickr.com/65535/52313928777_6887bd0305_o.jpg', 'https://live.staticflickr.com/65535/52313928777_6f28847aa4.jpg', '-7.810057', '110.358996', 'caspar40', 'Taman Sari or \"water palace\". Yogyakarta, Java.', 926),
(1300, '2022-08-27 10:17:01', 'Taman Sari was a mid 18th century, fortified palace surounded inside and outside with water. It was a pleasure palace for the sultans of Yogjakarta, who rested, bathed, meditated, or watched women bathing there. It also housed workshops and had a defence function. \nThe founder of this palace was said to have visited Dutch colonial Batavia (modern Jakarta) to learn more from the European architecture. Taman Sari integrates neatly traditional Javanese, muslim, Chinese and Dutch architectural influences. Today it is still beautifully preserved.', 'https://live.staticflickr.com/65535/52313928747_ffb9e77397_o.jpg', 'https://live.staticflickr.com/65535/52313928747_f60fd1c053.jpg', '-7.810228', '110.358953', 'caspar40', 'Taman Sari or \"water palace\". Yogyakarta, Java (Indonesia).', 600),
(1301, '2022-08-27 10:16:59', 'Taman Sari was a mid 18th century, fortified palace surounded inside and outside with water. It was a pleasure palace for the sultans of Yogjakarta, who rested, bathed, meditated, or watched women bathing there. It also housed workshops and had a defence function. \n\nThe founder of this palace was said to have visited Dutch colonial Batavia (modern Jakarta) to learn more from the European architecture. Taman Sari integrates neatly traditional Javanese, muslim, Chinese and Dutch architectural influences. Today it is still beautifully preserved.', 'https://live.staticflickr.com/65535/52315151399_fbcaba9c1b_o.jpg', 'https://live.staticflickr.com/65535/52315151399_55eac55173.jpg', '-7.810057', '110.358996', 'caspar40', 'Taman Sari or \"water palace\". Yogyakarta, Java (Indonesia).', 690),
(1302, '2022-08-27 10:16:57', 'Taman Sari was a mid 18th century, fortified palace surounded inside and outside with water. It was a pleasure palace for the sultans of Yogjakarta, who rested, bathed, meditated, or watched women bathing there. It also housed workshops and had a defence function. \n\nThis gate symbolized the mythical mountain Neru which had a divine connotation, even more seen the wings at the sides refer to the mythical bird Garuda. The gate reflects pre-islamic (hindu, indigenous animist) elements that survived into 18th century muslim Java.\n\nThe founder of this palace was said to have visited Dutch colonial Batavia (modern Jakarta) to learn more from the European architecture. Taman Sari integrates neatly traditional Javanese, muslim, Chinese and Dutch architectural influences. Today it is still beautifully preserved.', 'https://live.staticflickr.com/65535/52315167755_7d0192c562_o.jpg', 'https://live.staticflickr.com/65535/52315167755_b08ab2075c.jpg', '-7.809941', '110.359404', 'caspar40', 'Taman Sari or \"water palace\", Yogyakarta (Java, Indonesia).', 618),
(1303, '2022-08-27 10:04:14', 'Sunda Kelapa, the old (colonial) port of Jakarta.\nThe friendly boys are from the slum next to the harbour, living among severe polution, flooding and poverty. Yet they were still laughing and playing around like kids do.', 'https://live.staticflickr.com/65535/52314697991_53604b29b0_o.jpg', 'https://live.staticflickr.com/65535/52314697991_049580fdb8.jpg', '-6.124724', '106.807858', 'caspar40', 'Shy with a foreigner next to them. Jakarta, Indonesia.', 709),
(1304, '2022-08-27 10:04:07', 'Bandung, in West Java, became increasingly popular from the 19th century by the Dutch colonialists who were looking for a cooler, more pleasant climate than the humid, tropical Batavia (Jakarta) on the coast.\n\nThe city started to develop greatly between the end of the 19th century until the end of Dutch colonial rule in 1945. In this time, lots of neo-classical, neo-traditional, Art Nouveau, Art Deco and modernist buildings were built. The Dutch architecture was adapted to the tropical climate and blended with local Javanese and Chinese architectural design. Bandung is in fact in even one of the cities with the highest concentration of Art Deco buildings in the world! For this reason, it was once given the nickname &quot;Paris of the East&quot;. \n\nBandung to this day has preserved its homogenous historic centre relatively well. The town centre is beautiful and lush with tropical greenery, and well endowed with many artsy cafés serving excellent local Indonesian coffee.', 'https://live.staticflickr.com/65535/52315125544_d6a15b3a7f_o.jpg', 'https://live.staticflickr.com/65535/52315125544_880724d91a.jpg', '-6.921474', '107.609839', 'caspar40', 'Bandung, Dutch colonial old town. (Java, Indonesia).', 633),
(1305, '2022-08-27 09:57:21', 'Kota Tua district, where Dutch &quot;Batavia&quot; was first founded in the early 17th century. The buildings visible here date mostly to the early 20th century.', 'https://live.staticflickr.com/65535/52314994823_f50a6bebf5_o.jpg', 'https://live.staticflickr.com/65535/52314994823_edc25768e2.jpg', '-6.135615', '106.811957', 'caspar40', 'Dutch colonial buildings and canals. Jakarta, Indonesia.', 691),
(1306, '2022-08-27 09:57:20', 'The &quot;Toko Merah&quot; house, located at the old Dutch canal, is one of the oldest in the city, dating to the early 18th century when Jakarta was called Batavia and ruled by the Dutch VOC or East Indian Company.\n\nThe design of the bricks walls and big windows and doors are characteristic of Dutch architecture.\nNevertheless, tropical Javanese and Chinese influences are to be recognised in Dutch colonial buildings of Jakarta and elsewhere in Indonesia. Particularly the overhanging roofs protect agains heavy tropical rains and the buildings are designed to be more breezy.', 'https://live.staticflickr.com/65535/52313887632_43ea2921c8_o.jpg', 'https://live.staticflickr.com/65535/52313887632_628f8e2776.jpg', '-6.135754', '106.811313', 'caspar40', 'Street scene of Dutch colonial Jakarta, Indonesia.', 772),
(1307, '2022-08-27 09:57:18', 'On the background is the old city hall or &quot;Stadhuys&quot; that was already built in the 17th century. It was closely modelled on the city hall of Amsterdam. Public executions were also taking place from this square, and the civil servants of the VOC could watch the event from the windows in the middle. \nIn this time, Jakarta was called &quot;Batavia&quot;. It is now the old town (&quot;Kota Tua&quot;) of Jakarta and draws many foreign and local tourists.', 'https://live.staticflickr.com/65535/52314994678_3589bd1847_o.jpg', 'https://live.staticflickr.com/65535/52314994678_94b6959e03.jpg', '-6.134453', '106.812676', 'caspar40', 'Main square of Dutch colonial Jakarta, Indonesia.', 685),
(1308, '2022-08-27 09:57:06', '', 'https://live.staticflickr.com/65535/52314682641_3eb061e94c_o.jpg', 'https://live.staticflickr.com/65535/52314682641_a373109be8.jpg', '-6.127337', '106.809124', 'caspar40', 'Kitties are the new pirates in the colonial port of Jakarta', 751),
(1309, '2022-08-27 09:52:35', '', 'https://live.staticflickr.com/65535/52314672611_b992044364_o.jpg', 'https://live.staticflickr.com/65535/52314672611_1c45c11400.jpg', '-6.139850', '106.809639', 'caspar40', 'Chinese temple in Chinatown, Jakarta', 1014);
