(1317, '2022-11-22 10:17:11', '今日はぼくが尊敬する御年94歳の呉先生にお目にかかって、肖像写真を撮影。するとその眼差しの奥には、今でもはっきりと変わらない無垢な心が見える。そして同時に、緊張の中でもぼくにはやさしさも感じることが出来た。撮影後、共にいつもの先生が大好きなテンジャンチゲをご一緒し、少し別のことを考えていたら、その時先生から日本語で「楽しい！」に心が大きく揺れる。', 'https://live.staticflickr.com/65535/52516289427_d4cb5c497b_o.jpg', 'https://live.staticflickr.com/65535/52516289427_366026506d.jpg', '37.540794', '126.901788', 'ichigosugawara', '20221122 10:17 Seoul Korea', 52),
(1318, '2022-11-21 16:08:35', '本日より本当に久しぶりの韓国。ちょうど、先日の沖縄あたりから、東アジアというぼくたちの場所をもう一度しっかりと観てみたいと思っていたこともあって、やはりここ韓国でも特別な時間が生まれる。それもきっと、ぼくがこの歳になって生まれかわったせい。そして、ここから新しいプロジェクトがはじまる。', 'https://live.staticflickr.com/65535/52515119695_3f0402ef77_o.jpg', 'https://live.staticflickr.com/65535/52515119695_ca0bb5ddec.jpg', '37.555613', '126.921786', 'ichigosugawara', '20221121 16:08 Seoul Korea', 40),
(1319, '2022-10-23 13:19:30', 'Im Hinterhof der Botschaft Südkoreas steht der &quot;Pavillon der Einheit&quot;.\n\nEr ist einem ebensolchen, in der Gartenanlage des Königspalastes Changdeokgung in der südkoreanischen Hauptstadt Seoul gelegenen und als Pavillon Sangnyangjeong bezeichneten Bauwerk nachempfunden, das aus der Zeit der von 1392 bis 1910 herrschenden Joseon-Dynastie stammt.\nDie südkoreanische Regierung hatte ihn zum fünfundzwanzigsten Jahrestag der deutschen Einheit im November 2015 am Potsdamer Platz errichten lassen. Er sollte einerseits das Jubiläum der deutschen Einigung feiern und andererseits der Hoffnung Ausdruck verleihen, daß die Welt gemeinsam auch die Wiedervereinigung der beiden koreanischen Staaten unterstützt.\n\nNach seiner Fertigstellung fanden hier, organisiert vom südkoreanischen Kulturzentrum in Deutschland, zahlreiche Veranstaltungen wie Kalligrafiekurse und Verkostungen traditioneller Speisen und Tees statt, die den Einheimischen die koreanischen Traditionen näherbringen sollten.\n\nAls sechs Jahre später der mit der Stadt Berlin für das Grundstück geschlossene Nutzungsvertrag auslief, kam es nicht zu einer Verlängerung. Stattdessen wurde der Pavillon abgebaut und hierher verlegt - in den Hinterhof der südkoreanischen Botschaft.', 'https://live.staticflickr.com/65535/52491345274_d210952d98_o.jpg', 'https://live.staticflickr.com/65535/52491345274_6f3e3e98be.jpg', '52.507741', '13.347647', 'lt_paris', 'Der Pavillon der Einheit', 27),
