(1446, '2022-11-09 02:35:11', 'As an educator training people in peacebuilding, it was a privilege to work with people of many different cultures and from many different conflicts. \nKorea is very vulnerable, located as it is in east Asia and where it sits in its historical journey. Injecting a capacity to create peace and work towards reconciliation is critical work which is needed in each generation, in every university, and at all levels of national and international leadership. \nThis group of tertiary students were from Seoul Theological University, Sosa, South Korea.', 'https://live.staticflickr.com/65535/52488455925_c654c16c8f_o.jpg', 'https://live.staticflickr.com/65535/52488455925_f628af075a.jpg', '-33.779013', '151.033312', 'Ian & Marg', 'Korean Harmonies in the Australian Bush, Balaka Falls, Carlingford, Sydney', 148),
