(1448, '2022-11-01 14:51:39', 'Prof. Choi Chul, Professor of Law, Hankuk University of Foreign Studies, Seoul, Republic of Korea, speaks at the “Challenges to Intangible Asset Finance” panel of the <a href=\"https://www.wipo.int/sme/en/events/high-level-conversation.html\" rel=\"noreferrer nofollow\">High-level Conversation on Unlocking Intangible Asset Finance</a>. \n\nHeld at WIPO headquarters in Geneva, Switzerland, on November 1, 2022, the event highlighted the potential of using intellectual property and other intangible assets to support finance, and served as an initial step towards building an international community focused on intangible asset finance. It featured expert panels, an interactive workshop, as well as networking opportunities among participants including business leaders, intellectual property and finance experts, from both public and private sectors.\n\nMore: <a href=\"https://www.wipo.int/sme/en/news/2022/news_0018.html\" rel=\"noreferrer nofollow\">Inaugural High-level Conversation on Unlocking Intangible Asset Finance</a>\n\nCopyright: WIPO. Photo: Emmanuel Berrod. This work is licensed under a <a href=\"https://creativecommons.org/licenses/by/4.0/\" rel=\"noreferrer nofollow\">Creative Commons Attribution 4.0 International License</a>.', 'https://live.staticflickr.com/65535/52471076358_f53b779b74_o.jpg', 'https://live.staticflickr.com/65535/52471076358_f528996dbe.jpg', '46.222474', '6.136894', 'WIPO | OMPI', 'High-level Conversation on Unlocking Intangible Asset Finance: Challenges to Intangible Asset Finance – Part 1', 182),
(1449, '2022-11-01 15:24:56', 'Mr. Sung Hyun Sig, General Manager of the SMEs &amp; Startups Banking Department, KEB Hana Bank, Seoul, Republic of Korea, speaks at the “Challenges to Intangible Asset Finance” panel of the <a href=\"https://www.wipo.int/sme/en/events/high-level-conversation.html\" rel=\"noreferrer nofollow\">High-level Conversation on Unlocking Intangible Asset Finance</a>. \n\nHeld at WIPO headquarters in Geneva, Switzerland, on November 1, 2022, the event highlighted the potential of using intellectual property and other intangible assets to support finance, and served as an initial step towards building an international community focused on intangible asset finance. It featured expert panels, an interactive workshop, as well as networking opportunities among participants including business leaders, intellectual property and finance experts, from both public and private sectors.\n\nMore: <a href=\"https://www.wipo.int/sme/en/news/2022/news_0018.html\" rel=\"noreferrer nofollow\">Inaugural High-level Conversation on Unlocking Intangible Asset Finance</a>\n\nCopyright: WIPO. Photo: Emmanuel Berrod. This work is licensed under a <a href=\"https://creativecommons.org/licenses/by/4.0/\" rel=\"noreferrer nofollow\">Creative Commons Attribution 4.0 International License</a>.', 'https://live.staticflickr.com/65535/52470809434_bcdce5f44b_o.jpg', 'https://live.staticflickr.com/65535/52470809434_6b7ed47ee7.jpg', '46.222474', '6.136894', 'WIPO | OMPI', 'High-level Conversation on Unlocking Intangible Asset Finance: Challenges to Intangible Asset Finance – Part 2', 173);
