(1450, '2022-11-01 17:07:22', 'Ms. Lee Insil, Commissioner, Korean Intellectual Property Office (KIPO), Seoul, Republic of Korea, speaks at the “Stakeholder Input and the Road Ahead” panel of the <a href=\"https://www.wipo.int/sme/en/events/high-level-conversation.html\" rel=\"noreferrer nofollow\">High-level Conversation on Unlocking Intangible Asset Finance</a>. \n\nHeld at WIPO headquarters in Geneva, Switzerland, on November 1, 2022, the event highlighted the potential of using intellectual property and other intangible assets to support finance, and served as an initial step towards building an international community focused on intangible asset finance. It featured expert panels, an interactive workshop, as well as networking opportunities among participants including business leaders, intellectual property and finance experts, from both public and private sectors.\n\nMore: <a href=\"https://www.wipo.int/sme/en/news/2022/news_0018.html\" rel=\"noreferrer nofollow\">Inaugural High-level Conversation on Unlocking Intangible Asset Finance</a>\n\nCopyright: WIPO. Photo: Emmanuel Berrod. This work is licensed under a <a href=\"https://creativecommons.org/licenses/by/4.0/\" rel=\"noreferrer nofollow\">Creative Commons Attribution 4.0 International License</a>.', 'https://live.staticflickr.com/65535/52470036432_e80c9fce46_o.jpg', 'https://live.staticflickr.com/65535/52470036432_30df9c7b8c.jpg', '46.222474', '6.136894', 'WIPO | OMPI', 'High-level Conversation on Unlocking Intangible Asset Finance: Stakeholder Input and the Road Ahead', 208),
(1451, '2022-10-31 15:04:40', 'Amboise (Indre-et-Loire)\n\n\nNouvel emplacement de la sculpture de Calder, rue François Ier.\n\n\nCrinkly (1969)\n\nStabile-mobile d\'Alexander Calder (Philadelphie, 1898 - New York, 1976)\n\nIl existe un &quot;Crinkly avec disque rouge&quot; à Stuttgart, un &quot;Grand Crinkly&quot; à  Seoul et un autre &quot;Crinkly&quot; à New York... Etc...\n\n\nLe père d\'Alexander Calder était sculpteur et sa mère peintre. Passionné par la mécanique, Alexander Calder suivra une formation d\'ingénieur mécanicien.\n\nIl commence par le dessin en 1920. En 1923, il décide de s\'adonner à la peinture et s\'inscrit à l\'Art Students League à New York. \n\nEn 1927, à Paris, il donne des représentations avec son cirque fait d\'objets, personnages et animaux en fil de fer et en bois articulés. En même temps, il fabrique des jouets qu\'il exposera au salon des humoristes. Il rencontre Miró, progressivement se fait reconnaître et suscite l\'engouement de Cocteau, Man Ray, Desnos, et Fernand Léger. \n\nEn 1930, il rencontre Piet Mondrian et subit ce qu\'il appellera &quot;un choc déterminant&quot; : Il déclare vouloir faire des &quot;Mondrian qui bougent&quot;. Marcel Duchamp baptisera ses sculptures animées électriquement ou à la main &quot;Mobiles&quot;.\n\nSes premières sculptures animées uniquement par le vent datent de 1933. Ensuite, il crée de grandes sculptures fixes en feuilles d\'acier découpé, appelées «stabiles» par Hans Arp. \n\nEn 1943, il a droit à une rétrospective au Museum of Modern Art de New York? En 1946, Sartre préface son exposition à Paris: « Un objet de Calder est pareil à la mer et envoûtant comme elle, toujours recommencé, toujours neuf ».\n\nEn 1952, il obtient le grand prix de la Biennale de venise. \n\nEn 1957, Calder, qui passera plus de la moitié de sa vie en France, achète une maison au Palud, hameau de Roche Jaune, rattaché à la commune de Plougueil, dans les Côtes-d’Armor. \n\nEn 1967, il réalise plusieurs stabiles géants. Il crée un ballet de mobiles à l\'Opéra de Rome (1968). \n\nEn 1969, Calder réalise une affiche pour la &quot;Fête de l\'Humanité&quot;, les 6 et 7 septembre 1969 à Vincennes. (<a href=\"https://www.moma.org/collection/works/6889\" rel=\"noreferrer nofollow\">www.moma.org/collection/works/6889</a>)\n\nEn 1971, il s\'installe à Saché, en Indre-et-Loire, où il se fait construire un atelier. Atelier aujourd’hui transformé en résidence pour artistes.\n\n\n', 'https://live.staticflickr.com/65535/52470368718_17ea7cc432_o.jpg', 'https://live.staticflickr.com/65535/52470368718_3eae6e387f.jpg', '47.413055', '0.983797', 'sybarite48', 'Amboise (Indre-et-Loire)', 1010),
(1452, '2017-10-21 11:43:56', 'UN TRAGICO ASSEMBRAMENTO\n\n\nStrage nella calca a Seul per Halloween, almeno 153 morti e 82 feriti\nFesteggiavano nel quartiere di Itaewon. Imponenti i soccorsi con 140 ambulanze mobilitate. 355 le segnalazioni di persone scomparse.\nIl governo sudcoreano ha deciso sette giorni di lutto nazionale.\nIl presidente Yoon Suk-yeol ha affermato che questa tragedia &quot;non avrebbe dovuto verificarsi&quot;.\n----------------------------------------------\n\n\nA TRAGIC FESTIVAL\n\n\nMassacre in the throng in Seoul for Halloween, at least 153 dead and 82 injured\nThey celebrated in the Itaewon neighborhood. Impressive relief efforts with 140 ambulances mobilized. 355 reports of missing persons.\nThe South Korean government has decided on seven days of national mourning.\nPresident Yoon Suk-yeol said this tragedy &quot;shouldn\'t have happened&quot;.\n\n\nImmagine realizzata con lo smartphone SAMSUNG NOTE 4', 'https://live.staticflickr.com/65535/52465204676_1f792df13f_o.jpg', 'https://live.staticflickr.com/65535/52465204676_3a2bf377a1.jpg', '45.717701', '12.270569', 'FRANCO600D', 'FANTASMINI DI HALLOWEEN', 781),
