(1471, '1973-08-03 03:21:39', 'This is one of those thoroughly unartistic and time-degraded photos of mine that nevertheless has a lot of sentimental value. It records my first glimpse of that mythic Doric temple in one of the world\'s greatest architectural settings. \n\nAt the time, I was a lowly US Navy midshipman whose vessel was anchored off Piraeus. As soon as I wangled shore leave I hopped on the bus into Athens, and was so excited when I first saw the Parthenon appear over the walls of the Acropolis that I took this snapshot—of about one half of it.  \n\nObviously, I hadn\'t spent my college years saving up for a good camera or taking classes in photographic technique. All I had at hand was youthful enthusiasm and my trusty old Kodak Instamatic.\n\nStill, if one is inclined toward architectural geology, one can eluct a lot of significance even from an image like this. After all, it shows, in addition to a superabundance of blue Athenian sky,  an outcrop, a stone wall, and (part of) a building made of a well-documented rock type.\n\nAs my following Instamatic masterpieces in this series will show at closer range, the Parthenon is made of Pentelic Marble. But the Acropolis hill itself is composed of marlstone and sandstone capped by Late Cretaceous limestone. \n\nFortunately, the ancient Athenians had at their disposal, for their most important structures, the Pentelic, which is one of the world\'s finest white marbles. It was and still is quarried on Mount Pentelicus (Pentelikon), about 17 km (11 mi) northeast of the Acropolis. Originally sedimentary carbonate rock, the marble was metamorphosed into its present lovely form in the Late Cretaceous or Tertiary.   \n\nIn contrast, the imposing walls of the Acropolis are made limestone extracted from the Hill of the Nymphs and other nearby locales. These walls hold in a great deal of fill that was used to grade up the summit into a flatter surface. \n  ', 'https://live.staticflickr.com/65535/52525894880_c1cca56290_o.jpg', 'https://live.staticflickr.com/65535/52525894880_4e0d9f8fb1.jpg', '37.969950', '23.726080', 'rwgabbro1', 'Acropolis a la Instamatic 1: Playing Peekaboo with the Parthenon, Athens, Greece', 137),
