(1474, '2021-07-24 15:50:10', 'Royal Scottish Academy was designed by the renowned architect William Henry Playfair, 1822-6.  It was enlarged by Playfair, 1832-35.  Greek Doric temple built from Culallo and Craigleith sandstone ashlar. Fluted Greek Doric columns; acanthus frieze below Doric entablature with wreathed metopes and mutuled cornice; scrolled foliate carving in pediments. Prostyle octostyle porticoes to N and S. Colonnades to W and E with distyle pedimented projections to ends. Statue of Queen Victoria above N portico and paired sphinxes to each corner.\n\nW.H. Playfair was (arguably) the most prominent architect (others include Thomas Hamilton and Archibald Elliot) responsible for Edinburgh achieving the tag &quot;Athens of the North&quot; due to his use of Greek Revival architecture and this building is probably the finest example.\n\n[For John].', 'https://live.staticflickr.com/65535/52521764493_f6b4d5182a_o.jpg', 'https://live.staticflickr.com/65535/52521764493_7c403a3d7e.jpg', '55.951939', '-3.196291', 'David_Leicaman', 'Royal Scottish Academy, Edinburgh', 54),
