(1479, '2022-11-17 06:48:46', 'The Athens Polytechnic uprising occurred in November 1973 as a massive student demonstration of popular rejection of the Greek military junta of 1967–1974. It began on 14 November 1973, escalated to an open anti-junta revolt, and ended in bloodshed in the early morning of 17 November after a series of events starting with a tank crashing through the gates of the Athens Polytechnic.   ', 'https://live.staticflickr.com/65535/52519115998_27a522b6ec_o.jpg', 'https://live.staticflickr.com/65535/52519115998_d27524813a.jpg', '37.981669', '23.731799', 'Eleanna Kounoupa', 'March on the anniversary of the uprising of the Polytechnic in Athens', 105),
