(1482, '2022-11-09 11:17:31', 'Πανελλαδική απεργία στον ιδιωτικό και δημόσιο τομέα ενάντια στην ακρίβεια και την εξαθλίωση, στην οποία έχει καταδικάσει εκατομμύρια νοικοκυριά η κυβέρνηση Μητσοτάκη.\nΣτιγμιότυπα από τη συγκέντρωση και πορεία στην Αθήνα. \nPan-Hellenic strike in the private and public sector against exactness and impoverishment, to which the Mitsotakis government has condemned millions of households.\nMoments from the gathering and march in Athens.', 'https://live.staticflickr.com/65535/52518089032_52132e6443_o.jpg', 'https://live.staticflickr.com/65535/52518089032_2922ef9154.jpg', '37.980257', '23.731391', 'Eleanna Kounoupa', 'Πανελλαδική απεργία στις 9 Νοεμβρίου 2022', 100),
